INSERT INTO `cms_content` (`id`, `nodeId`, `locale`, `heading`, `body`, `css`, `url`, `pageTitle`, `breadcrumb`, `metaTitle`, `metaDescription`, `metaKeywords`) VALUES
(1, 1, 'en_us', 'SAP ABAP Tutorial', '{{heading}}\n<h4>Introduction to SAP</h4>\n<ol><li>Concept of Data Warehousing</li>\n<li>What is an application</li>\n<li>Overview of different SAP products</li>\n</ol><h4>Modeling in BW</h4>\n<h4>Extraction</h4>\n<h4>Reporting</h4>\n\n\n\n\n', '', '', '', '', '', '', ''),
(2, 2, 'en_us', NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(3, 4, 'en_us', 'Dance classes by chandra', '<h4>Dance classes by chandra</h4>\n<p>Dance classes by chandra in evening hours at Malakpet Play graounds. All are welcome</p>', '', '', '', '', '', '', ''),
(4, 5, 'en_us', NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(5, 6, 'en_us', NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(6, 7, 'en_us', NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(7, 8, 'en_us', NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(8, 9, 'en_us', NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
