(10, 13, 'en_us', '', '<strong>INTRODUCTION TO SAP AND ABAP/4 LANGUAGE</strong>\n<ul><li>\nOverall introduction to ERP</li></ul><ul><li>\nIntroduction SAP R/3 architecture, Introduction to SAP ABAP/4</li></ul><ul><li>\nABAP/4 editor (Focus on the functionalities of new ABAP editor)</li></ul><ul><li>\nData types</li></ul><ul><li>\nOutput statements</li></ul><ul><li>\nWriting small programs</li></ul><ul><li>\nArithmetic operations</li></ul><ul><li>\nString operations</li></ul><ul><li>\nControl statements</li></ul><ul><li>\nParameters</li></ul><ul><li>\nOpen SQL statements {insert, modify, delete, update}.</li></ul><ul><li>\nSimple reporting</li></ul><ul><li>\nSelection screens</li></ul><ul><li>\nTransaction code creation</li></ul>', '', '', '', '', '', '', ''),
