(2, 0, 0, 2, 0, '<p align="justify" class="body_txt_innerpage" style="padding-left: 10px;">\r\n	The School is recognized permanently by the Govt. of Andhra Pradesh vide proceedings Rc.6319, dated 15-09-1883. The school is a Catholic Christian Religious Minority Institution established and administered within the scope and ambit of the safeguards of Art. 29 &amp; 30 of the Indian Constitution.</p>\r\n<p align="justify" class="body_txt_innerpage" style="padding-left: 10px;">\r\n	The subjects taught are,</p>\r\n<ol>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			I Language ( Hindi / Telugu )</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			II Language ( Hindi / Telugu )</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			III Language &ndash; English</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			Mathematics</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			Physical and Biological Sciences</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			Social Studies</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			Computer Science</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			Value Education / Faith Formation</p>\r\n	</li>\r\n	<li>\r\n		<p align="justify" class="body_txt_innerpage">\r\n			General Knowledge</p>\r\n	</li>\r\n</ol>\r\n', 'ashs', 'Hyderabad', '20101220112547.gif', 118, 'All Saints High School', '', '040 2323 5153', '2323 5153', '500001', 'Door No. 5-9-304', 'Gunfoundry, Hyderabad ', 'http://allsaintshighschool.com', 0, 0, 'school', 2, 0, 2012, 1347096972, 153),
(5, 0, 109, 0, 0, '<p>\r\n	The <b>Hyderabad Public School, Begumpet</b> or <b>HPS, Begumpet</b>, is a <a class="mw-redirect" href="http://en.wikipedia.org/wiki/Public_school_%28privately_funded%29" title="Public school (privately funded)">public school</a> in <a href="http://en.wikipedia.org/wiki/Hyderabad,_India" title="Hyderabad, India">Hyderabad</a> in the <a href="http://en.wikipedia.org/wiki/India" title="India">Indian</a> state of <a href="http://en.wikipedia.org/wiki/Andhra_Pradesh" title="Andhra Pradesh">Andhra Pradesh</a>.</p>\r\n<p>\r\n	It was established in 1923 as a school for the members of the Indian aristocracy. It is situated on a160-acre (0.65 km<sup>2</sup>) campus with buildings ranging from the modern to <a class="new" href="http://en.wikipedia.org/w/index.php?title=Qutub_Shahi_architecture&amp;action=edit&amp;redlink=1" title="Qutub Shahi architecture (page does not exist)">Qutub Shahi architecture</a> in architectural styles. Children are schooled from the primary stage through to the 12th standard (age 3 to age 17). The school is affiliated to the Council for the Indian School Certification Examinations (ICSE, ISC). Its administrative body is the <i>Hyderabad Public School Society</i>.</p>\r\n<p>\r\n	The school has four houses - Nagarjuna, Vijaynagar, Taxila and Nalanda. Students are divided into these house and participate in inter-house competitions.</p>\r\n', 'hps', 'Hyderabad', '20101220112654.jpg', 0, 'Hyderabad Public School', '', '040 27761546', '27761546', '500001', 'Mayur Marg, Begumpet', '', '', 0, 0, '', 1, 0, 2012, 1347131126, 153),
(6, 0, 0, 0, 0, '<p>\r\n	The International Institute of Information Technology, Hyderabad (IIIT-H) is an autonomous university founded in 1998. It was set up as a not-for-proft public private partnership (NPPP) and is the frst IIIT to be set up (under this model) in India. The Government of Andhra Pradesh lent support to the institute by grant of land and buildings. A Governing Council consisting of eminent people from academia, industry and government presides over the governance of the institution.</p>\r\n<p>\r\n	IIIT-H was set up as a research university focused on the core areas of Information Technology, such as <em>Computer Science, Electronics and Communications, </em>and their applications in other domains. The institute evolved strong research programmes in a host of areas, with computation or IT providing the connecting thread, and with an emphasis on the development of technology and applications, which can be transferred for use to industry and society. This required carrying out basic research that can be used to solve real life problems. As a result, a synergistic relationship has come to exist at the Institute between basic and applied research. Faculty carries out a number of academic industrial projects, and a few companies have been incubated based on the research done at the Institute.</p>\r\n', 'iiht', 'Gachibowli', '20101220112737.jpg', 109, 'IIIT-H', '', '040 23001967', '040 23001967', '500032', 'Gachibowli', 'Opposite CMC', 'http://www.iiit.net/', 0, 0, '', 1, 0, 2013, 1359982598, 153),
(8, 0, 0, 0, 0, 'St.Peter''s mission is to provide a rigorous and broad education within the context of a Christian environment. An understanding of the Roman Catholic faith, in line with the Gospel message, underpins the whole work of the school.\r\n\r\nSt.Peter''s main aim is to develop the self-esteem, dignity and respect of all members of the community by concentrating on each person’s infinite worth in the eyes of God.\r\n\r\nThe school’s Christian ethos underpins all its work and provides all members of the school community with a safe environment which is paramount in creating a successful learning environment. All students receive lessons in religious education and our Catholic identity and spiritual life are reflected in all areas of our school.', '', 'Bowenpally', '/etutoreal/assets/uploads/avatars/153-school.JPG', 0, 'St Peter''s High School', '', '040 27953770', '040 27953770', '500011', 'Near Mallareddy Gardens', '', 'http://www.stpetershighschool.org.uk/', 0, 0, 'school', 2, 0, 2012, 1347268044, 153),
(9, 0, 0, 0, 0, '<p>\r\n	Bharatiya Vidya Bhavan&rsquo;s Public School, Jubilee Hills, is an English medium secondary school, affiliated to the Central Board of Secondary Education, New Delhi. The school was inaugurated by His Holiness Swami Ranganathanandaji, President of Ramakrishna Mutt on July 5th, 1979 and presently has classes from L.K.G to XII. Bhavan&rsquo;s Vidyashram boasts strength of 2900 students and 130 teaching and non-teaching staff members. Located on a sprawling 8 acres of land in Filmnagar, Jubilee Hills, the school has a three storeyed main block, separate primary, 3 state-of-the-art computer labs, basket ball court, 2 tennis courts, 4 volleyball courts, 6 table tennis enclosures, on-site hostel facilities, canteen, stationery shop and amenities block.</p>\r\n<p class="test">\r\n	Apart from the academic curriculum, students have a choice of various activity-oriented subjects like drama, music, am and crafts, knitting, embroidery, cookery, oil painting, dramatics, candle making, yoga, electronics. karate and gymnastics. Excursions are arranged periodically for recreation and educational purposes. The school also has a well equipped library.</p>\r\n', '', 'Jubilee Hills', '20101220112854.jpg', 0, 'Bharatiya Vidya Bhavan''s Public School', '', '040-23544934', '23544934', '500033', 'Road No.71, Film Nagar,', '', 'http://www.bvbpsjh.com/', 0, 0, '', 2, 0, 2012, 1347094821, 153),
(10, 2, 0, 0, 0, 'The school''s vision is  “To see all children from Johnson able to adjust, with respect, in a fast changing global environment, with the ability to lead in the field of their choice with integrity and courage”. \r\n\r\n\r\nMission:\r\n\r\nWe, the staff of J.G.S. I.C.S.E. in partnership with students, parents and community, are committed to develop the potential of every child and nurture him or her with “CARE”. The mission is to challenge all students to reach their potential and to develop responsible citizens in a caring and supportive environment.\r\n', '', 'Habsiguda', '', 0, 'JOHNSON GRAMMAR SCHOOL I.C.S.E.', '', '040-27173841', '040-27150555', '500 007', 'street #3', 'kakatiya nagar', 'http://www.jgschool.org/', 0, 0, '', 2, 0, 2012, 1347268962, 146),
(11, 30, 109, 0, 0, '<p>\r\n	EuroSchool is a venture of EuroKids International Ltd-promoters of EuroKids &ndash;India&rsquo;s largest pre-school chain with over 650 pre-schools in 260 towns and cities across India. The beginning of this voyage can be traced back to the birth of &#39;EuroKids&#39; - India&#39;s leading provider of Pre-School education.</p>\r\n', '', 'Jubilee Hills', '20101220112955.gif', 0, 'EuroSchool', '', '040 65888855', '9849584664', '500033', '1-98/B/85/1', 'Near DVR College', 'http://www.euroschoolindia.com/', 0, 0, '', 2, 0, 2012, 1347269246, 153),
(12, 0, 0, 0, 0, 'Niraj Public School established in 1986, has completed two eventful decades and is affiliated to the Council for the India School Certificate Examination (ICSE), New Delhi.\r\n', 'ICSE', 'Begumpet', '20101220113036.gif', 0, 'Niraj Public School', '', '040 23413543', '040 23413543', '500016', 'Saadat Manzil, 6-3-864', 'Ameerpet', 'http://www.nirajpublicschool.com/', 0, 0, '', 2, 0, 2012, 1347095371, 153),
(13, 0, 0, 0, 0, '', '', '', '', 3, 'Cambridge High School', '', '', '', '', '', '', '', 0, 0, '', 1, 0, 0, 0, 153),
(14, 0, 0, 0, 0, 'The School has the aim of inculcating love and human fraternity while providing holistic education to meet the needs of the individual and the society. All that happens in the school and outside and events of the past and present are transformed into a learning experience. Novel and creative means of imparting curriculum is used to keep the learner curious and interested. Curriculum is made vibrant by the active involvement of the students in Project Work, Experiments and other assignment works. Efforts are made to renew teaching, learning and evaluating strategies. Audio-visuals and latest technologies are put to optimum use.\r\n\r\n\r\n        Many co-curricular activities are planned in literary, cultural, sports and games to tap, nurture and develop talents to a level of excellence, keeping the students highly motivated.', '', 'Abids', '', 0, 'Little Flower High School', '', '', '00000000000', '500001', 'chiragali lane', '', 'http://www.lfhshyd.org/', 0, 0, '', 2, 0, 2012, 1347272600, 153),
(15, 0, 109, 0, 0, '<p>\r\n	St. Ann&#39;s College for Women was established by the Sisters, Society of St. Ann, in 1983, as an institution oriented towards the cause of need-based education, aiming at optimum growth. Their vision and single-minded dedication saw the college evolve from a humble beginning with just two courses, to a model college with all possible conventional and restructured courses, added year after year at undergraduate and postgraduate levels.</p>\r\n', 'NAAC', 'Humayun Nagar (Hyd)', '20101220113214.gif', 6, 'St Anns College for Women', '', '040 23513020', '040 23513020', '500028', 'Mehdipatnam', '', 'http://www.stannscollegehyd.com', 0, 0, '', 1, 0, 2013, 1359982438, 153),
(16, 0, 0, 0, 0, '<p>	Kennedy High School was established in the year 1999,with the aim to impart quality education to children.We strongly believe that the need of the hour is to adopt innovative educational methodology, to make learning easy to the child.Each child is unique and blessed with enormous amount of intelligence and school is the place where the students mind is opened to expolartion and discovery and the results are bound to be amazing.</p>', '', 'Kukatpally', '20101220113316.jpg', 0, 'Kennedy Public School', '', '040 23051790,', '9705566481', '500072', '# 6-11/4A & 4B', '', 'http://www.kennedyhighschoolhyd.com/', 0, 0, '', 2, 0, 2012, 1347290883, 153),
