(18, 0, 0, 0, 0, 'The school stands for character formation, academic excellence and the development of skills, with a view to training citizens distinguished for their sincere commitment to God, country and fellow-men: living and working for the cause of Truth, Justice, Peace and Integrity of Creation.', '', 'Hyderabad', '', 0, 'Rosary Convent Girls High School', '', '23241387', '23230704.', '500002', 'Gunfoundry', '', 'http://rosaryconventschhyd.com', 0, 0, '', 2, 0, 2012, 1347295539, 153),
(19, 0, 0, 0, 0, 'Badruka College of works towards the goal of continuous improvement, discovery and sharing of knowledge with young men and women by providing them broad based quality higher education on international standards. The institution strives to transform them into enlightened, spiritually inspired, emotionally balanced, self reliant, morally upright and socially committed citizens of the country.', 'PGDM, M SC, M C A, B COm, PGDITM', 'Stn Kachiguda', '/etutoreal/assets/uploads/avatars/153-badruka.gif', 0, 'Badruka College', '', '040 24654471', '040 24654471', '500027', 'Badruka  Educational  Society,', 'Kachiguda,', 'http://www.badruka.com/home/home.html', 0, 0, '', 2, 0, 2012, 1347959511, 153),
(20, 0, 109, 1, 0, 'JGI has a long history of excellence in all genre of education. Our strengths have developed from outstanding students, dedicated employees, top institutions, a genuine commitment to students and a strong desire to contribute to the nation. The fundamentals of academic brilliance, cultural activities, sporting excellence and spiritual evolution in students are simultaneously progressing under the guidance of entrusted facilitators and a world-class infrastructure.', 'Professional Sports Training, Arts and Fine Arts, Learning labs for Maths, Social  Science and Science, Yoga and Karate, nursery to grade 7, international level sports', 'Secunderabad', '20101220113535.jpg', 0, 'The Jain International School', '', '040 65225246', '040 65225246', '500003', 'Plot No. 73 Jeera,', 'Opp Hanuman Temple,', 'http://www.tjis.ac.in', 0, 0, '', 2, 0, 2013, 1370059246, 153),
(21, 0, 0, 0, 0, 'Vasavi Public School was established in August 1983 and has completed 26 years in imparting quality education. The school equips the children with knowledge and right values thus grooming the children in totality. \r\n\r\nThe school is sponsored by Vasavi Academy of Education, a renowned philanthropic organization managing a number of educational institutions in the city and outside. The school is a vivid manifestation of our motto ‘’LEARN TO SERVE’’ and dedicated to the students of today to be worthy citizens of tomorrow. \r\n\r\nThe school is affiliated to Central Board of Secondary Education New Delhi. It is a co-educational English medium institution having classes from Pre-Primary to Class X. The subjects offered are English, Mathematics, General Science, Social Science, Hindi (Course B) / Telugu/Sanskrit as II language and Telugu/Hindi/Sanskrit as III Language. In addition, to the above subjects the school also offers work experience. Art Education, Health and Physical Education and other Co-Scholastic subject like Music, Dance, Yoga, Creative writing, Theater, Life skills, attitudes and values.\r\n ', '', 'Hamayatnagar (Hyd)', '', 0, 'Vasavi Public School', '', '040 23220975', '040 23221712', '500029', '3-6-215', '', 'http://www.vpshyd.ac.in', 0, 0, '', 2, 0, 2012, 1347350223, 153),
(22, 0, 0, 0, 0, '<p>\r\n	<span class="style3">Gitanjali School is all about ethics, values, positive attitude and character building of young students. Gitanjali School is the spirit, that makes human beings humane, permeates the school, moulding scholars and sportsmen to steer India and the globe in its path of progress. Gitanjali School is a natural and tranquil institution away from the clamor of the city, nurtures an ideal educational environment for both students and teachers, a place to build leaders of future generations.&nbsp;</span></p>\r\n', '', 'Begumpet', '20101220113654.jpg', 6, 'Gitanjali Senior School', '', '040 27768420.', '996608542', '500016', 'Begumpet,', '', 'http://gitanjalischools.org/aboutus.html', 0, 0, '', 1, 0, 2013, 1359982700, 153),
(23, 0, 0, 0, 0, '<p>\r\n	Nasr provides an ideal education to prepare for the 21st Century. The school offers a strong academic programme, an exceptional faculty, superb campus, kaleidoscope of co-curricular activities and community involvement programme.</p>\r\n<p>\r\n	The teachers prepare the students for a new century characterized by rapid and constant change. The students are equipped to play an active role in the international world where people and cultures surpass national boundaries.</p>\r\n<p>\r\n	Nasr Teaching Technology converge in a single, all encompassing goal.</p>\r\n', '', 'Khairatabad', '20101228075516.jpg', 118, 'Nasr School', '', '040 23307555', '9966048682', '500004', '6-2-905,', 'Nasr School KHUSHNUMA', 'http://www.nasrschool.net/', 0, 0, '', 2, 0, 2012, 1347214934, 153),
(24, 0, 0, 0, 0, '', '', '', '', 3, 'Loyola High School', '', '', '', '', '', '', '', 0, 0, '', 1, 0, 0, 0, 153),
(25, 0, 0, 0, 1, '<p>\r\n	SRI INTERNATIONAL SCHOOL AND COLLEGE is a successful and innovative School offering education from Play-school to Higher Secondary Education based in Central Hyderabad.&nbsp;</p>\r\n<p align="justify" class="body_main">\r\n	(T.H.E WORLD SCHOOL) SRI INTERNATIONAL SCHOOL AND COLLEGE are under the aegis of Taksasila Educational Society, Narayanguda, Hyderabad.&nbsp; Taksasila Educational Society was established in 1974 by Mr.Shaik Fakruddin, a prominent educationist.&nbsp; In its three decades of service, our Society produced a number of IAS, IPS, IFS etc Indian Service Officers besides leading doctors and engineers.&nbsp;Mr.Shaik Fakruddin is the brain behind introducing International Curriculum and Certifications to Indian Students with the main objective of providing Effective Education for Employment which provides knowledge, skills and behaviours&nbsp; required for a job in any profession.ing Effective Education for Employment which provides knowledge, skills and behaviours&nbsp; required for a job in any profession.</p>\r\n', '', 'Himayathnagar', '20101228075245.gif', 118, 'Sri International School', '', '040 23261111', '9290821111', '500029', '3-5-1016, Street No. 5', 'Himayathnagar', 'http://www.sriinternationalschool.edu.in/', 0, 0, '', 2, 0, 2012, 1350461980, 153),
(26, 0, 0, 0, 0, '<p align="justify">\r\n	Spread across 4 acres of land amidst the idyllic serenity of the foot hills, the School is away from the mundane existence of the congested city. The lush greenery and ambience provides a scenic background for the vista of information and knowledge unfolding within the school.</p>\r\n<p align="justify">\r\n	The hallmark of Mount Carmel Global School is its emphasis on the uniqueness of each child. Each section has a student strength of 24 that ensures individual attention. The perfect balance between academics and activities makes learning a both challenging and enjoyable.</p>\r\n<p>\r\n	Mount Carmel envisages a learning atmosphere, with all its members actively involved in the teaching-learning process to make it more meaningful to the child.</p>\r\n', '', 'Kanchanbagh', '20101220113937.jpg', 0, 'Mount Carmel Global School', '', '040 32523253', '9959311233', '500058', 'Survey # 138', 'Near Balapur Cross Roads,', 'http://www.mountcarmelhyd.com/', 0, 0, '', 2, 0, 2012, 1347266045, 153),
(27, 0, 0, 0, 0, 'The humble beginning took place in 18, Wahab Nagar, Sikh Village, Secunderabad in a 2 bedroom rented house on the 21st of June 1984. The school flourished under the ‘child centered’ educational philosophy of its founders. In order to provide more open space to conduct a number of activities for the all round development of children the school shifted to its own premises spread in 3 and 1/2 acres about 10 km from Secunderabad Railway Station and Hyderabad Airport.', '', 'Secunderabad.', '', 0, 'Sherwood Public School', '', ' 42402214', ' 040-64512584', '', 'Petbasheerabad', 'Jeedimetla Village', 'http://www.sherwoodpublicschool.com', 0, 0, '', 2, 0, 2012, 1347267165, 153),
(28, 0, 0, 0, 0, '', '', '', '', 3, 'Nalanda Public school', '', '', '', '', '', '', '', 0, 0, '', 1, 0, 0, 0, 153),
(29, 0, 0, 0, 0, '<p>\r\n	The Pragati Maha Vidyalaya junior college was started with a moderate strength of 43 students in 1969-70 with the munificent donation made by Sri Tokarshi Lalji Kapadia Public Charitable Trust. The Degree College with commerce course was started in 1973 with the generous donation by M.C.Modi Educatinal Trust. The present premises located in the heart of the city was purchased by the Samaj in the year 1974 and both the colleges were shifted to this premises in the same year from the rented buildings situated at Nampally. During the last two decades, the management has spent more than one crore of rupees on the construction of the buildings and at present there are 70 halls to conduct the classes, besides a vast open area with an administrative complex and well equipped laboratories for Electronics,Physics and Computers. The new office complex was added this year. We can boast of having one of the best computer labs in twin cities.</p>\r\n', 'school, pragati', 'Boggulkunta', '20101220114052.jpg', 6, 'Pragati Maha Vidyalaya', '', '040 24753887', '9944556698', '500001', 'Hanuman Tekdi, Kandaswamy Lane, ', ' Beside SBI, ', 'http://www.pragatimahavidyalaya.in/', 0, 0, '', 1, 0, 2013, 1359981952, 153),
(30, 0, 109, 0, 0, '', '', '', '', 3, 'Sujatha K G & Upper Primary School', '', '', '', '', '', '', '', 0, 0, '', 1, 0, 0, 0, 153),
(31, 0, 0, 0, 0, '<div align="left" style="color: rgb(0, 0, 0); font-family: courier new,monospace;">\r\n	<font size="2">The &#39;Sunrise High School&#39; was formed by a group of life-long educationists with a vision for the future.&nbsp; Currently,&nbsp;<a href="http://sites.google.com/site/sunrisehighschool/nostalgia">Mrs. Adeeb Muneer</a> is&nbsp;its chairperson. <br />\r\n	<br />\r\n	</font></div>\r\n<p>\r\n	<font size="2">&#39;Sunrise High&#39; true to its name had humble beginnings.&nbsp; It was an effort to uplift the children of the weaker section in a remote corner of the city, MuradNagar, and to expose them to modern compulsions and challenges.&nbsp;&nbsp;It was this little effort way back in 1958 by <a href="http://sites.google.com/site/sunrisehighschool/nostalgia">Late Mrs. Akbari Rauf</a>, an educationist herself, that has taken concrete shape.&nbsp;&nbsp;</font> <font face="Arial, Geneva, sans-serif" size="2" style="color: rgb(0, 0, 0); font-family: courier new,monospace;">&nbsp; </font> <font face="Arial,  Geneva, sans-serif" size="2" style="font-family: courier new,monospace;"><font>The school is affiliated to the State Board of Andhra Pradesh, India. It was first recognized by the Govt.of AP in 1963. The first batch of students appeared for the&nbsp;7th class common examination in 1974.&nbsp;From a middle school, Sunrise was upgraded to a high school exclusively for girls in 1991.&nbsp; The school started with a humble strength of 60 students and has about 700 children on roll today, with a team of about 25 well qualified and&nbsp;experienced teachers and has&nbsp;completed 49 years of service in imparting education. Every year the students of classes&nbsp;7th and&nbsp;10th (SSC) pass out in flying colours.&nbsp; The school board members and the parent committee work together for the betterment of the school.<br />\r\n	&nbsp; </font></font><font face="''Trebuchet MS'', ''Lucida Grande'',  sans-serif" size="2" style="font-family: courier new,monospace;"><br />\r\n	</font>&#39;Sunrise High&#39; is located in Muradnagar, 1/2 km from Mehdipatnam crossroads. It has a sound, well ventilated building with a playground and a garden of its own. Lot of trees make the place green and clean.</p>\r\n', '', 'Muradnagar', '/etutoreal/assets/uploads/avatars/151-sunrisehs.jpeg', 3, 'Sunrise High School', '', '040 23530495', '', '500028', '12-2-332/1', 'Near old Mehdipatnam Bus Depot', 'http://sites.google.com/site/sunrisehighschool/', 0, 0, '', 1, 0, 2010, 1292089450, 153),
(32, 0, 0, 0, 0, '<p>\r\n	Sister Nivedita School abides by is to ensure an educational environment that is child-centred and the &#39;learning journey&#39; of each and every child is a blissful one. Therefore in every parent-teacher gathering we endeavour to discover every child&#39;s distinctive qualities and nurture them to the maximum scope possible. Also, the academic studies are balanced with overall development so that the child can progress to the next class in the short run and blossom as a confident adult in the long run.<br />\r\n	<br />\r\n	Sister Nivedita School believes in the proven &#39;activity-based learning&#39; model which is the central force behind CBSE&#39;s success. The school ensures that the <a href="http://www.onlinecasinodollar.com/" style="text-decoration: none; color: rgb(42, 42, 42); cursor: default;">class</a> strength is less so that students can take full advantage of this advanced teaching methodology. In short, we believe that marks and academic percentages are important but should not be considered the end-all of education.</p>\r\n', 'CBSE', 'Begumpet', '/etutoreal/assets/uploads/avatars/151-niveditahs.png', 3, 'Sister Nivedata School', '', '040 23731518', '9848994411', '500016', 'Ameerpet', '', 'http://www.snschool.com/', 0, 0, '', 1, 0, 2010, 1292090121, 153),
(33, 0, 0, 0, 0, '', '', '', '', 3, 'St George''s Boys Grammar School', '', '', '', '', '', '', '', 0, 0, '', 1, 0, 0, 0, 153),
(34, 0, 0, 0, 0, '<p>\r\n	At Orchids - The International School, education means drawing out the inner qualities, strengths and creativity of every child. The school aims to provide the world with citizens who become leaders, role models of purpose, integrity, character and discipline.<br />\r\n	<br />\r\n	Every child at Orchids is taught and guided to grow into a well rounded personality and become an inspiration to others.<br />\r\n	<br />\r\n	Orchids aims to provide a scientific learning environment where both the students and teachers participate as friends in the process of learning. Modern teaching aids and scientifically developed curriculum is the cornerstone of education at Orchids. At Orchids - The International School, academics attain top priority where learning is interactive.<br />\r\n	<br />\r\n	In a nutshell, the school provides high quality learning in a very scientifically structured, positive and caring environment that meets every child&rsquo;s needs.</p>\r\n', 'CBSE', 'Jubilee Hills', '/etutoreal/assets/uploads/avatars/151-orchids.jpg', 28, 'ORCHIDS International School', '', '040 42021001', '', '500033', 'Plot No 72 & 73, Phase –I', 'Kavuri Hills,', 'http://www.orchidsinternationalschool.com/', 0, 0, '', 1, 0, 2010, 1292090582, 153),
(35, 0, 0, 0, 0, '<p>\r\n	<strong>NARAYANA EDUCATIONAL INSTITUTIONS</strong> are one of the best education providers in India from the pre-primary to professional post graduation, have been successful in an uninterrupted and dedicated task of perfectly shaping worthy leaders of India as good doctors, good engineers, good human beings and professionally competent citizens. We feel, we have ignited in their minds a love for science, and through it, a sense of mission for achieving a developed India.<br />\r\n	<br />\r\n	We proudly accept that, ocean of parents dreams came into reality by our uncompromising education system and educational reforms which were taken up for the cause of educating young minds.</p>\r\n', '', 'Dilsukhnagar Colony', '/etutoreal/assets/uploads/avatars/151-narayanacs.jpg', 3, 'Narayana Concept Schools', '', '040 23465762', '', '500060', '# 17-85 / 1, ', 'Beside Annapurna Kalyana Mandapam, Srinagar Colony, ', 'http://www.narayanaconceptschools.org/', 0, 0, '', 1, 0, 2010, 1292091211, 153),
