(37, 0, 0, 0, 0, '<p>\r\n	<span style="font-family: Arial;">Sreenidhi</span><span style="font-family: Arial;"> International School currently offers both ICSE (Delhi, India) and IGCSE (CIE, U.K) streams, under the guidance of qualified and trained teachers. Sreenidhi International School is an authorized school for the International Baccalaureate Diploma Programme for students who will be qualified to pursue the Grades XI and XII. </span></p>\r\n<p>\r\n	<span style="font-family: Arial;">Students who wish to join Grade 11 of ISC curriculum could contact School.</span></p>\r\n', 'ICSE', 'Banjara Hills', '/etutoreal/assets/uploads/avatars/151-sreenidhiis.gif', 3, 'Srieenidhi International School', '', '040 23351022', '', '500034', '8-2-579/A, H. No. 76,', 'Road No. 8', 'http://www.sreenidhiinternational.com/', 0, 0, '', 1, 0, 2010, 1292091925, 153),
