(40, 0, 114, 0, 0, '<p align="justify">\r\n	FKS, started on February 8th 1997. It started with 20 students on a 4,000 square feet rented space with one teacher and five support staff.</p>\r\n<p align="justify">\r\n	Shailaja has a skill in finding real time solutions to problems faced by people, and her ability to understand children. Her childhood was spent as an uncared student at school. She concluded, &quot;If this is not what I want of a school, there must be others too who feel the same way as I do.&quot; The answer was FKS.</p>\r\n', '', 'Jubilee Hills', '/etutoreal/assets/uploads/avatars/151-futurekids.jpg', 114, 'The Future Kid''s School', '', '040 23545045', '', '500033', '79-B,', 'Journalist Colony (Near Apollo Hospital)', 'http://www.fkshyderabad.com/', 0, 0, '', 1, 0, 2010, 1292093712, 153),
(41, 0, 0, 0, 0, '<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span id="ctl00_ContentPlaceHolder1_lblAboutCareCenter">Located at the elite Banjara Hills area. Once inside the spacious school grounds, the gates are closed by the security guard posted at the gate.</span></p>\r\n<p>\r\n	<span id="ctl00_ContentPlaceHolder1_lblAboutCareCenter">&nbsp;</span></p>\r\n<p>\r\n	<span id="ctl00_ContentPlaceHolder1_lblAboutCareCenter">Kalpa offers classes from the nursery to the tenth with ICSE syllabus and additional selected reading to give academics a holistic feel.</span></p>\r\n<p>\r\n	<span id="ctl00_ContentPlaceHolder1_lblAboutCareCenter">&nbsp;</span></p>\r\n<p>\r\n	<span id="ctl00_ContentPlaceHolder1_lblAboutCareCenter">Kalpa School with&nbsp;a huge palatial building, swimming pool, skating rink is like a home away from home where children love to spend their day.</span></p>\r\n<p>\r\n	<span id="ctl00_ContentPlaceHolder1_lblAboutCareCenter">&nbsp;</span></p>\r\n<p>\r\n	<span id="ctl00_ContentPlaceHolder1_lblAboutCareCenter">Kalpa as a school, believes in a holistic approach to education. Education that helps in the blossoming of the physical, mental, intellectual, social, emotional and spiritual dimensions of a child.</span></p>\r\n', 'ICSE', 'Manovikasnagar', '/etutoreal/assets/uploads/avatars/151-kalpaschool.png', 3, 'Kalpa School', '', '040 23350164', '', '500009', '#19, Avenue 5', 'old road no. 8, Banjarahills', 'http://www.kalpaschool.in', 0, 0, '', 1, 0, 2010, 1292094258, 153),
