(44, 0, 0, 0, 0, '<p>\r\n	<strong>Devnar</strong>&rsquo; is a combination of two words <strong>DEV (God)</strong> and<strong> NAR (Man)</strong>, highlighting the fact that there is God in every man. If the entire humanity is the family of God, the visually challenged children are special members in it. And so, they should be given every possible opportunity to develop their potentialities and latent talents. Devnar Foundation tries to unleash the incredible capacity of students by giving them value based education thus enabling them to realize that within them can be found the skill, knowledge and motivation to make something special happen. The Foundation aims to provide opportunities on par with international standards for the visually challenged children in India so that they can be absorbed in the mainstream of society as socially productive individuals. In Devnar School, education, boarding and lodging are absolutely free and any Visually Challenged child is admitted during any part of the year.</p>\r\n', '', 'Begumpet', '/etutoreal/assets/uploads/avatars/151-devnar.gif', 3, 'Devnar School For The Blind', '', '040 27767931', '', '500016', '1-10-122 to 125, ', 'Mayurmarg', 'http://www.devnarfoundationfortheblind.org/', 0, 0, '', 1, 0, 2010, 1292094748, 153),
(45, 0, 0, 0, 0, '<table align="center" border="0" cellpadding="0" cellspacing="0" width="800">\r\n	<tbody>\r\n		<tr>\r\n			<td bgcolor="#ffffff" class="style10">\r\n				<span class="style8">Matrusri rises on the horizon</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td bgcolor="#ffffff">\r\n				&nbsp;</td>\r\n			<td bgcolor="#ffffff">\r\n				<span class="L5content"><font color="#5f5f5f">One zeal driven young man with overhelming ambition dreamt of spreading quality education to the nook and corner of the country and that too at the<br />\r\n				very doorstep of every needy and aspiring student especially from rural area . The dream sprouted in the form of Matrusri in 1990 with its location<br />\r\n				Nallakunta. The dream gradually transformed itself into a vision. With his intense devotion and commitment MATRUSRI was established more than a<br />\r\n				decade ago with the intension of creating awareness about career building amoung students.</font></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', 'Nallakunta', '/etutoreal/assets/uploads/avatars/151-school.JPG', 3, 'MATRUSRI', '', '040 27619469', '', '500044', '#2-1-290/5/1', 'st.opp.vijaya bank', 'http://www.matrusri.com/', 0, 0, '', 1, 0, 2010, 1292095212, 153),
