(50, 0, 0, 0, 0, '<p align="justify">\r\n	<strong>St. Francis College for Women </strong>is a Catholic Minority Institution. It was founded in 1959 by the Sisters of Charity for the empowerment of women through a value &ndash; based holistic education. The UGC conferred <a href="http://stfranciscollege.ac.in/aboutus_ins.htm"><strong>Autonomy</strong></a> on the college in the year 1988. The College has been awarded the status of College with<strong> <a href="http://stfranciscollege.ac.in/aboutus_ins.htm">Potential for Excellence</a></strong> by the UGC in the year 2004 in recognition of its sustained efforts to promote quality education for women. This created an academic ambience for promoting innovation and creativity in the curriculum of the college. The <strong><a href="http://stfranciscollege.ac.in/aboutus_ins.htm">National Assessment and Accreditation Council</a> (NAAC) </strong>has <strong>Reaccredited</strong> the college at the &lsquo;<strong><em> A</em></strong>&rsquo; Level in February 2006. It is a matter of pride for all concerned that our Curriculum, Teaching - Learning and Evaluation and Infrastructure facilities have been graded at the &lsquo;<strong><em>A+</em></strong>&rsquo; Level. This is a further boost to the college in its commitment to quality education and academic excellence.</p>\r\n<p align="justify">\r\n	In keeping with the changing trends in the field of higher education at the global scenario, the college is introducing <strong>Inter Disciplinary Electives (IDE)</strong> as an integral part of <strong>Choice and Credit Based Semester System </strong>from June 2006. This is a positive step towards achieving parity with educational institutions elsewhere in the world.</p>\r\n', 'NAAC', 'Begumpet', '/etutoreal/assets/uploads/avatars/151-St.francis.jpg', 3, 'St. Francis College for Women', '', '040 23403200 ', '', '500016.', 'Street no. 6', 'Uma Nagar', 'http://stfranciscollege.ac.in/', 0, 0, '', 1, 0, 2010, 1292095780, 153),
