(55, 0, 0, 0, 0, '<p>\r\n	NARAYANA EDUCATIONAL INSTITUTIONS one of the best education providers in India from the pre-primary to professional post graduation, have been successful in an uninterrupted and dedicated task i.e. Perfectly shaping worthy leaders of India as good doctors, good engineers, good human beings and professionally competent citizens. We proudly accept that ocean of parents dreams came into reality by our uncompromising education system, which is taken up for the cause of educating young minds. &ldquo;Educate to elevate and Inspire to awake&rdquo; i.e. our conviction. So it is established education with unlimited resources, evolving ingenious methods, outstanding teaching techniques for the aspirants with zeal of learning. &ldquo;Learning starts before the age of 5 years-develop physically, intellectually, socially, environmentally&rdquo;&hellip;&hellip; So we created and evolved the best environment for the creative young minds by inspiring to achieve their goals. &ldquo;Teaching and training students is an outstanding technique&rdquo; but motivating and inspiring them is a hi-technique. It is our strong pillars with commitment. Our experienced faculty focuses on imparting invaluable knowledge through sharp and shortcut methods and inspires the student to put their maximum capabilities to complete the given task devotionally. The secret leads us and our students for a successful career.</p>\r\n', '', 'Old Malakpet', '/etutoreal/assets/uploads/avatars/151-narayanacs.jpg', 3, 'Narayana Jr College', '', '040 23465877,', '', '500036', '16-11-477/6/3/6,', 'MOOSARAMBAGH, DILSUKHNAGAR', 'http://www.narayanagroup.com/', 0, 0, '', 1, 0, 2010, 1292096365, 153),
