(67, 0, 114, 0, 0, '<p>\r\n	EuroSchool &ndash; Welcome to Balanced Schooling. The school that has brought the highly enriching international educational experience within the reach of Indian parents through the concept of Balanced Schooling &hellip;</p>\r\n<p>\r\n	At EuroKids, we work towards exploring the innate potential of each child believing each child to be unique. Our goal is to stimulate their curiosity, guide them to explore, help them to acquire skills and instill the joy of learning which would set the tone for the rest of their lives.</p>\r\n<p>\r\n	Our programs incorporate an integrated curriculum that promotes learning primarily through music, art, drama, dance, projects, discover centers, computer activities, field trips, outdoor play and adventure.<br />\r\n	<br />\r\n	EuroKids India, with its innovative approach, has set up a many preschools, playschools and kindergarten programs across India to work towards the development of kids.</p>\r\n', '', 'Secunderabad', '/etutoreal/assets/uploads/avatars/151-eurokids.jpg', 114, 'Euro Kids', '', '040 64577300, ', '93955 96100', '500003', '# 1-8-32/5, Bapu Bagh Colony,', ' P G Road', 'http://www.eurokidsindia.com/', 0, 0, '', 1, 0, 2013, 1359983284, 153),
(68, 0, 0, 0, 0, '', '', '', '', 3, 'St Theresas Girls High School', '', '', '', '', '', '', '', 0, 0, '', 1, 0, 0, 0, 153),
(69, 0, 0, 0, 0, '<p>\r\n	Amoeba Education is founded on the principle that next generation schools will be led by School Leaders and Teachers who have the capabilities and skills to shape 21st century Education.<br />\r\n	<br />\r\n	<strong><em>&quot;Changing the World by Changing the Way We Learn&rdquo; is our motto </em></strong><br />\r\n	<br />\r\n	Amoeba Education is a network of professionals focused on <strong>Charting</strong> the <strong>Path to excellence</strong> in learning for all. Our resource team of current and former K-12 schools leaders, technology leaders, and trainers are committed to providing the highest quality solutions through a blended model of international teaching learning practices. We are involved in developing, designing, and delivering <strong>Teaching Learning Pathways</strong> for educators and students as we strive to help educational systems -- schools, organizations, parents, and community -- create integrated learning systems where learning is mandatory for all, not just for children.</p>\r\n', '', 'Trimulgherry', '/etutoreal/assets/uploads/avatars/151-amoeba.jpg', 3, 'amoeba', '', '', '9866188390', '500015', '# P-33, AWHO Ved Vihar', 'Subhash Nagar', 'http://www.amoebaeducation.com/', 0, 0, '', 1, 0, 2010, 1292097620, 153),
