(72, 0, 0, 0, 0, '<p>\r\n	ECHOES started as a Pre-School in 1995 and since then we have rolled out various courses that take care of the skill enhancement needs of children from 6 months to 16 years. Over years of experience and research we have built courses that would help children &quot;learn how to learn&quot;. Once the urge to learn is instilled in the child, the learning process becomes fun-filled.</p>\r\n<p>\r\n	We believe that every child is a prodigy and unique in his or her own way. The talent hidden in them could be brought out to the best possible extent if the appropriate environment is provided to them and if their needs are attended to by the right people. ECHOES strives to provide the appropriate environment and the specialised faculty to nurture the mental and physical abilities of a child.</p>\r\n', '', 'Begumpet', '/etutoreal/assets/uploads/avatars/151-echoesIndia.gif', 3, 'ECHOES', '', '040 27764535 ', '9000955486', '500016', 'Plot no. 11, Gagan Vihar Colony, ', 'Near Old Airport, ', 'http://www.echoesindia.com/', 0, 0, '', 1, 0, 2010, 1292097993, 153),
(73, 0, 0, 0, 0, '<p>\r\n	Radcliffe School promises to deliver quality education with an emphasis on a deep rooted value system. Here, our education is aimed at nurturing the children&rsquo;s intellect and supporting their emotional, moral and spiritual well-being.</p>\r\n<p>\r\n	We appreciate the unique, individual talents of children and follow an instructional strategy that suits their different learning styles. This multi-faceted learning-teaching approach allows children to understand and imbibe lessons completely and apply them to real-life situations. The school&rsquo;s active and dynamic learning environment provides them with a wholesome education experience. To ensure that not a single child is left out in this process, we have developed an intelligent learning delivery model which we call IntelligeX that ensures multi-dimensional learning of every child and helps us bring out their natural talent and give shape to their creative thinking.</p>\r\n<p>\r\n	At the school, we have impeccable infrastructure facilities for the pursuit of the teaching-learning activity. Our science laboratories are well-equipped with modern scientific apparatus and equipment, to carry out experiments given in Radcliffe Superbooks. Well-stacked library, projector &amp; computer enabled classrooms, activity hall and sports facilities combine to form a perfect ground for unleashing the child&rsquo;s true potential.</p>\r\n', '', 'Balanagar Township', '/etutoreal/assets/uploads/avatars/151-radcliffes.jpg', 3, 'Radcliffe School', '', '040 23774987', '9346008802', '500037 ', '6 - 30, 31 & 32,', 'Opp. IDPL R&D Centre ', 'http://radcliffe.in/', 0, 0, '', 1, 0, 2010, 1292098451, 153),
