(76, 0, 0, 0, 0, '<table align="center" border="0" cellpadding="0" cellspacing="0" class="text85" width="97%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<strong>Bhavan&rsquo;s New Science College, a pioneer of Higher Education</strong> was established on 17th July 1956 by two great visionaries and dedicated educationists, Late Sri C. Sudershan and Late Sri G. S. Melkote under the management of Nutan Vidhya Samithi. A band of distinguished scholars, academicians and leaders of erstwhile Hyderabad state joined to provide them science education for the needy students of this region at Narayanaguda in Hyderabad.</td>\r\n		</tr>\r\n		<tr>\r\n			<td height="8">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<strong>Bhavan&rsquo;s New Science College</strong> is devoted for the spread of education with socio-ethical, cultural and philanthropic values. The management consists of dedicated personality with social and philanthropic out look who constantly oversee and guide the college in perusing its objectives..</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', 'Narayanguda', '/etutoreal/assets/uploads/avatars/151-school.JPG', 3, 'Bhavans New Science College', '', '040 24750150', '', '500029', 'Door No: 3-5-116 to 121, Near Old MLA Quarters,', 'opposite to Shalimar Function Hall, ', 'http://newsciencecollege.org/bhavan.html', 0, 0, '', 1, 0, 2010, 1292098801, 153),
