(79, 0, 0, 0, 0, '<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span class="style5">Rajadhani Residential School</span> is the first undertaking of Rajadhani Academy<br />\r\n	&nbsp;established to facilitate higher standards in various academic disciplines.<br />\r\n	Rajadhani stands for emphasis upon the ancient notion of guru <br />\r\n	sishya sampradaya <span class="bold-text style3">&ldquo;GURUKULASHRAMAM&rdquo;</span> which provides for the<br />\r\n	&nbsp;alround development of personality of the pupil.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p class="style1">\r\n	The basic aims and objectives of Rajadhani School are:<br />\r\n	-Inculcating culture based on professionalism, technology, scientific temper and concern&nbsp;for the needy.<br />\r\n	-Facilitating the self expression in one&rsquo;s own natural disposition.<br />\r\n	-Developing the habits of reading.<br />\r\n	-Development of young pupil in to an alround personalilty.</p>\r\n<p class="style1">\r\n	<span class="style1">he school is a co-education day cum residential school. It is the maiden venture of the academy established in 1987 by the well known philanthropist Makkapati Chandrasheker Rao, and other executive body members. His holiness Sri Sri Sri Jagadguru Vijayendra Saraswathi of Kanchi Kamakoti Peetam inaugurated the school and the hostel building on 9th May 1988 and the school has been upgraded to <strong>x</strong> standard and recognition been granted by the Central Board of&nbsp; Secondary Education, New Delhi.</span></p>\r\n', 'CBSE', 'Kukatpally', '/etutoreal/assets/uploads/avatars/151-srajadhanirs.jpg', 3, 'Sree Rajadhani Residential School', '', '040 23058077', '9392509373', '500072', '2-79, Rajadhani Vidya Nager,', 'Nizampet', 'http://srrschool.com/', 0, 0, '', 1, 0, 2010, 1292099424, 153),
