(82, 0, 0, 0, 0, '<div align="justify">\r\n	<font color="#4db147" face="Verdana" size="2"><strong>Little Flower Junior College</strong></font><font color="#000000" face="Verdana" size="2"> is a minority Institution established by the Montfort Brothers of St. Gabriel. It was started in July 1974 as a part of Little Flower High School, Hyderabad, and was shifted to the new campus at Uppal in July 1982.</font></div>\r\n', '', 'Uppal', '/etutoreal/assets/uploads/avatars/151-littleflowerjc.gif', 3, 'The Little Flower Jr College', '', '040 27201375', '', '500039    ', 'UPPAL', 'Hyderabad', 'http://www.lfjrc.com/', 0, 0, '', 1, 0, 2010, 1292099899, 153),
