(89, 0, 0, 0, 0, '<h1>\r\n	<a href="http://manthanschool.org/" title="Manthan International School Hyderabad">Manthan International School Hyderabad</a><br />\r\n	&nbsp;</h1>\r\n<p>\r\n	<strong>Manthan&nbsp;International School</strong>&nbsp;is promoted and run by a group of professionals with a passion for education. The vision of the school is to provide all round education and nurture a child&rsquo;s innate curiosity and help the child achieve excellence.</p>\r\n<p>\r\n	Manthan&nbsp;runs<span class="apple-converted-space"> a school in </span><strong>Madhapur, </strong><span class="apple-converted-space"> </span><strong>Hyderabad</strong> today and a second school is in the planning stage near<strong> Gachibowli, Hyderabad</strong>. The school in Madhapur is quite highly appreciated by the parents who admitted their children and the school near Gachibowli will become operational next year. The Madhapur School has classes from Play School to Class 7 and the Gachibowli School will have classes from Play school to Class 12....&nbsp;<a href="http://manthanschool.org/about-school.html" title="About Manthan ">Manthan International Schools Hyderabad</a>.<b><br />\r\n	</b></p>\r\n', 'CBSE', 'Madhapur', '/etutoreal/assets/uploads/avatars/151-manthanis.gif', 6, 'Manthan International School', '', '040 42206060', '80088 83223', '500081', '1150 ', 'Ayyappa Society Main Road', 'http://manthanschool.org/', 0, 0, '', 1, 0, 2013, 1359982991, 153),
