(102, 0, 0, 0, 0, 'St.Andrews Started in 1987 by the Emanuel family, in memory of the Late Louis William Emanuel, St. Andrews is managed by the St. Louis Education Society. St. Andrews take pride from the fact, that this institution has made a perceptible change in the way education is imparted to the budding citizens of our great nation. \r\n\r\n\r\nMrs. B. Joseph is one of the promoters of St. Andrews. She has been in the field of education for well over 25 years. Despite her physical disabilities, she is still the force within St. Andrews. Her dedicated service to this institution is unparalleled. While nobody can question her abilities as an educationist, few know the fact that prior to getting into education, she was the Financial Controller of the world famous London based Selfridges Group. In fact she was the first Asian to hold such a post. She is a strict disciplinarian and her exacting standards have seen St. Andrews remain at the top right from its inception more than two decades ago. She is blest with the rare ability to combine strict discipline and kindness. Joseph Ma’am, as she is fondly addressed by her staff will vouch for that. \r\n', '', 'secunderabad', '', 0, 'St.Andrews High School', '', '+91 40 6521 1825 ', '+91 40 6457 6555  ', '500 011', 'Survey No. 52', 'Bowenpally,', 'http://www.standrewsindia.com/', 0, 0, '', 2, 0, 2012, 1347351856, 0),
