(105, 0, 0, 0, 0, 'MARICA HIGH SCHOOL was founded by M.C. de Rochemonteix, CONM, a French lady and is now managed by Marica Higher Educational Society. It was established in 1992. Since its inception, Marica High School has put up efforts to develop the vision of knowledge, social outlook and excellent career of the students with the support of very friendly, enthusiastic, qualified and trained staff.\r\n\r\nTHE MOTTO OF THE SCHOOL\r\n\r\nLOVE PEACE HARMONY The school has its own building. It is spacious and centrally located. Classrooms are well lit and ventilated for a hygienic study atmosphere. The school is being affiliated to CBSE, Delhi for classes I to X. The school is run by experienced and dedicated professionals', 'U K G, L K G, nursery, I class to x class', 'Langar House', '', 0, 'Marica High School', '', '040 23568310', '040 23567142 ', '500008', '949-4-77-3-29-234, Nizam Colony, Toli Chowki', 'Golconda', 'http://maricaschools.org', 0, 0, '', 2, 0, 2012, 1347979249, 0),
