(108, 0, 0, 0, 0, 'Saint Ambrose School is a small school with a big heart. The faith-based education offers a nurturing and challenging academic environment for children in kindergarten through eighth grades. The diverse student body is represented by children from five of the seven continents. Students are welcomed from different ethnic and socio-economic backgrounds. The shared vision of the Catholic faith promotes unity and appreciation for each person’s unique gifts, encouraging understanding and cooperation within the student body. Weekly Mass, daily prayers, and a shared culture of faith build a true community.', '', 'Basheerbagh', '', 0, 'St. AMBROSE SCHOOL', '', '040 65506473', '9848057096', '500029', '5-9-34/1, ', 'Behind Parmila Nursing Home, Opp Gandhi Medical College', 'http://www.askme.com/hyderabad/basheerbagh-institu', 0, 0, '', 2, 0, 2012, 1347957512, 0),
