(110, 0, 0, 0, 0, 'Anwarul Uloom Colllege was founded in 1957 by Moulvi Abdul Razzack Saheb, Moulvi Jawahar Khan Saheb and Moulvi Nizamuddin Sahaeb with a view to provide  value – based holistic education. The UGC conferred Autonomy on the college in the year 1988. The National Assessment and Accreditation Council (NAAC) is visiting the college soon to accredit the college and we expect that we will be accredited at the '' A'' Level..\r\n\r\nVision\r\n Holistic Education for empowerment and Transformation of Society.\r\n\r\nMission\r\n Striving to help students to develop into intellectually competent, morally upright, socially committed and spiritually inspired, patriotic citizens of India.\r\n', '', 'Hyderabad', '/etutoreal/assets/uploads/avatars/151-anwarul.gif', 0, 'Anwarul-Uloom Educational Association', '', '', '040-23342285 ', '500001', '#11-3-918', 'New Mallepally,', 'http://www.anwarul-uloom.com/', 0, 0, '', 2, 0, 2012, 1347355405, 0),
