(117, 0, 0, 0, 0, '<p>\r\n	Sancta Maria is a part of the well-respected St. Mary&rsquo;s Educational Society. Founded in 1982, the Society has under its fold, St. Mary&rsquo;s Junior College, Himayathnagar and St. Mary&rsquo;s College, Yousufguda &ndash; institutions that have been making a mark in quality education for over 27 years now. So, a combination of experience and in-depth expertise in the field of education guides Sancta Maria International School.</p>\r\n<p>\r\n	The name Sancta Maria is a Latin title for Mary the mother of God. It means Holy Mary or simply St. Mary&rsquo;s.</p>\r\n<p>\r\n	Sancta Maria is the foundation to a confident future. The red box represents the world. The three strokes represent the road to knowledge, progress and excellence. The colour red stands for energy, enthusiasm and passion.</p>\r\n<p>\r\n	Sancta Maria is driven by the motto &ldquo;In Omnia Excellentia&rdquo;, which means, Excellence in Everything.</p>\r\n<p>\r\n	At Sancta Maria we strongly believe that the only gateway to a good life is through good education.</p>\r\n', '', 'Lingampalli', '/etutoreal/assets/uploads/avatars/151-sanctamaria.gif', 3, 'Sancta Maria International School', '', '040 64616000', '', '500019', 'Survey No. 106/107', 'Serilingampally', 'http://www.sanctamaria.in/', 0, 0, '', 0, 0, 2010, 1292102273, 0),
(118, 0, 0, 0, 0, '<table border="0" cellpadding="0" cellspacing="0" width="88%">\r\n	<tbody>\r\n		<tr>\r\n			<td width="100%">\r\n				<p align="justify">\r\n					<font face="Arial"><span style="font-size: 9pt;">Sharada&rsquo;s Kids, the brain child of enthusiastic and enterprising professionals who strive to provide the tiny tots the fun way of schooling.<br />\r\n					<br />\r\n					At Sharada&rsquo;s the emphasis mainly lies on nurturing the little ones blossom into socially, intellectually, mentally and emotionally matured citizens through child centered curriculum of international standards which equips the kids with a strong foundation to face the demanding day to day life.</span></font></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td width="100%">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td width="100%">\r\n				<span style="font-weight: 700;"><font color="#cc0066" face="Arial" style="font-size: 9pt;">The Mission</font></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td width="100%">\r\n				<font face="Arial" style="font-size: 9pt;">At Sharada&rsquo;s we believe in providing an outstanding environment to nurture and groom each child in order to make them reach their full capabilities academically, physically, emotionally and spiritually by imparting world class education with the most advance curriculum.</font></td>\r\n		</tr>\r\n		<tr>\r\n			<td width="100%">\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 'Vengal Rao nagar', '/etutoreal/assets/uploads/avatars/151-sharadakids.gif', 3, 'Sharada''s Kids', '', '040 2370 3397', '', '500038', '# B-4', 'Madhura Nagar', 'http://www.sharadaskids.com/', 0, 0, '', 0, 0, 2010, 1292102724, 0),
(119, 0, 0, 0, 0, '<p>\r\n	Hi-tech Modern High School and Residential Schools were established with the aim to impart quality education to the students aspiring to carve a bright future.<br />\r\n	<br />\r\n	Hi-tech Modern High School&#39;s objective is to provide to its students the best possible resources to develop into the kind of human beings that the world needs today and would need tomorrow. Towards the accomplishment of this objective, we never compromise in regard to the best faculty, the best possible infrastructure, Labs and Library which enable the students to advance further into the ever-expanding regions of knowledge.</p>\r\n', '', 'Bowenpally', '/etutoreal/assets/uploads/avatars/151-hitech.jpg', 3, 'Hi Tech Modern Residential High School', '', '040 42007750', '', '500011', 'Swarna Dhama Nagar, Military Dairy Farm Road,', 'Secunderabad', 'http://hitechresidential.com/', 0, 0, '', 0, 0, 2010, 1292103114, 0),
(120, 0, 0, 0, 0, '<p>\r\n	Prerana Waldorf School was initially a conventional School &ndash;by the name, Mount Banjara High School. It was founded in June 1996 by Maj. D.V.V.P Varma and Mrs. Indira Varma, who had an inherent desire to serve the community through education. It is a co-educational school with a tradition of providing quality education to all, irrespective of ethnic and cultural differences. Prerana Waldorf School invites you to explore Waldorf education which integrates arts, sciences and movement. This school is based on the Waldorf curriculum from Nursery to Grade VIII and dovetails into the CBSE and SSC Boards from Class IX to Class X. Prerana Waldorf School is on the International list of Waldorf Schools</p>\r\n', '', 'Gachibowli', '/etutoreal/assets/uploads/avatars/151-prerana.jpg', 3, 'Prerana Waldorf School', '', '040 23005930', '9949573870', '500032', 'Plot 47/9,Near Telecom Nagar Bus stop', 'Opposite NCC Urban,', 'http://www.waldorfprerana-india.org/', 0, 0, '', 0, 0, 2010, 1292103536, 0),
