(122, 0, 0, 0, 0, '<table border="0" cellpadding="0" cellspacing="4" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td align="center">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td align="center">\r\n				<table border="0" cellpadding="0" cellspacing="4" width="100%">\r\n					<tbody>\r\n						<tr>\r\n							<td align="center">\r\n								<div align="justify" class="content">\r\n									<strong>Oxford Grammar School </strong>has dedicated its service in this field for two decades.<br />\r\n									&nbsp;</div>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td align="center">\r\n								<div align="justify" class="content">\r\n									Even though the main activity of the school is primarily to impart education by strictly adhering to the curriculum, various other activities are also actively encouraged to bring in healthy competition among the student community.<br />\r\n									&nbsp;</div>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td align="center">\r\n								<div align="justify" class="content">\r\n									It is only the beginning of the long march in the history of Oxford Grammar School. Much more, about the Institution, Its guiding philosophy and facilities available, you can find in pages to follow.<br />\r\n									&nbsp;</div>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td align="center">\r\n								<div align="justify" class="content">\r\n									Discipline, with freedom to look far and wide, with an Emphasis on all round personality development has been the cardinal principle followed at Oxford Grammar School.</div>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align="center">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td align="center">\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 'Himayathnagar', '/etutoreal/assets/uploads/avatars/151-oxfordgrammar.jpg', 118, 'Oxford Grammer School', '', '040 27635669.', '040 27635669.', '500029', 'St. #11,"CHANDRAM", 490, ', 'Himayatnagar', 'http://www.oxfordgrammarschool.com/', 0, 0, '', 2, 0, 2012, 1347215251, 0),
(123, 0, 0, 0, 0, '<table align="center" border="0" cellpadding="0" cellspacing="0" width="97%">\r\n	<tbody>\r\n		<tr>\r\n			<td align="left" valign="top" width="68%">\r\n				<p>\r\n					Ahlebait (Institute) High School started 38 years ago in the historic Charminar area of old city of Hyderabad, INDIA. It is an English medium co-educational school. It is a private school recognized by the State Government. The school conducts classes starting from the Lower KG to 10 th Class.</p>\r\n				<p>\r\n					The present strength of the school is roughly 500 students. The results of previous academic year have been quite satisfactory. Last year the 7th grade results were 99% and that of the 10th grade were 75%.</p>\r\n				<p>\r\n					The school is equipped with a science lab, a computer lab, a library and a seminar hall because we at our school believe in overall development of a child thus we encourage games and other co-curricular activities also. However studies at our school are always given higher value.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align="left" height="22" valign="top">\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td align="left" height="20" valign="top">\r\n				<strong>SCHOOL RECOGNITION</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td align="left" valign="top">\r\n				The State Governments Education Department reviews the performance and functioning of the school regularly. The State Government recognition for the school is granted for every five years. The school was granted further recognition for an additional five academic years in 2004.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 'Hasannagar', '/etutoreal/assets/uploads/avatars/151-ahlebaiths.jpg', 3, 'Ahle Bait High School', '', '040 24576628 ', '', '500052', 'Bi Bi Bazaar', 'Charminar,', 'http://www.ahlebaitschool.org/', 0, 0, '', 0, 0, 2010, 1292104509, 0),
