(127, 0, 0, 0, 0, '<p align="justify">\r\n	<font face="Verdana" size="2">Bhoj Reddy Engineering College for Women (Formerly ISS College of Information Technology and Engineering for Women) was established in 1997 and has been sponsored by Sangam Laxmibai Vidyapeet (SLV) headed by Dr&nbsp; Ramlakshmi, a physician and administrator is the Correspondent of the College. The SLV is a registered voluntary social action group working for empowerment of women and girls through education since 1952.</font></p>\r\n<p align="justify">\r\n	<font face="Verdana" size="2">The Engineering College is managed by an executive committee consisting of persons with long experience in the field of education.</font></p>\r\n', 'NBA', 'Saidabad', '20101222200757.jpg', 6, 'Bhoj Reddy Engineering College for Women', '', '+91-40-24537281', '+91-40-24537281', '500059', 'Vinay Nagar Saidabad,', '', 'http://www.brecw.ac.in', 0, 0, '', 1, 0, 2013, 1359982310, 151),
(128, 0, 0, 0, 0, '<p class="dm_first_p">	Created by an Act of the Indian Parliament, the University of Hyderabad, has, over three decades, distinguished itself as one of the best in the country as a centre for teaching, research and innovations. With a highly qualified and internationally renowned faculty, motivated students, scholars, and support staff, it has carried out cutting edge research in disciplines such as the sciences, social sciences, humanities, technology, visual arts, communication, management and continuing education.</p><p>	Right from its inception, the University has pioneered teaching, research and extension activities in the best possible manner, keeping with the mandate given to it by the nation. It has vigorously sought interdisciplinary and interface studies in frontier areas across disciplines. It has hired high quality faculty, and the admission of outstanding students, at the national and international level, while keeping its commitment to the important goal of social justice. Today, it has a thriving undergraduate program of the integrated kind, and its post-graduate studies and research programs rival some of the best in the country. It has broken fresh ground in the Study in India (SIP) program involving international students.</p>', '', 'Osmannagar', '20101227100818.jpg', 6, 'University of Hyderabad', '', '23132103', '958245221', '500036', 'University of Hyderabad', '', 'http://www.uohyd.ernet.in', 0, 0, '', 1, 0, 2013, 1359981841, 154),
