(137, 0, 0, 0, 0, 'Shobha Indani has been taking cookery classes for the last 18 years in Pune as well as many other places in India.The institute Shobha Indani''s Cookery Classes was independently started 4 years back. Till date, over 2000 students have successfully completed the one month certificate course at the Institute.\r\n\r\n Located in the heart of the city, the institute also provides Hostel facility for the students coming from all over India for the one month certificate course. The hostel has a Female Rector and Security Guards 24 hours a day. Along with the Cooking Course, the Institute also offers various other courses which are conducted simultaneously during the one month duration of the course. The various other courses are taught by a replete faculty which comprises of people specializing in their particular field.\r\n\r\n Besides, there are special sessions with 5 star chefs who give important tips on Icing and the latest trends in International Cooking. The language of instruction for all the classes is Hindi and all the demonstrations, notes and books are in simple and easy hindi language.', 'South Indian', 'S B P Pune', NULL, 0, 'Shobha Indani''s Cookery Classes', '', '020 – 25532434', '020 – 25532434', '411022', '1225/E, Samir apts, ', 'Off F.C.road, Deccan', 'http://shobhaindanirasoi.co.in', 0, 0, '', 0, 0, 2012, 1338871686, 0),
