(158, 0, 0, 0, 0, 'VS Technologies Pvt. Ltd. is the Offshore Training Center of V-Soft Consulting Group, Inc., headquartered in Louisville, Kentucky.\r\n\r\nV-Soft has a legacy of 8 years experience in virtually all aspects of the Information Technology business and is a specialty ERP-CRM/Data Warehousing, Training, staffing and consulting services firm. \r\n\r\nV-Soft has established its beach-head in India, under the name VS Technologies (VST), to access the large pool of software talent available in India and nurture it by providing the industry-centric & cost effective corporate training solutions, and hence to spearhead its charge into global ERP market more aggressively.\r\n\r\nVS Technologies is a strategically located Training Institute located in the heart of the Cyber city of India - Hyderabad. VS Technologies is known for its pioneering work in the field of IT education and training. Our strong research orientation has helped us continuously innovate in the areas of instructional design methodologies, and curricula development that is cutting-edge.', 'SAP ABAP, SAP Webdynpro', 'Old Begumpet', '20120417130004.jpg', 0, 'SAP ABAP Webdynpro Training', '20120417130004.jpg', '', '32505115', '500016', '401,402 4th floor, # 6-3-789, Pavani Prestige,  Ameerpet, Hyderbad-500016', '', 'http://www.vstechnologies.net/', 0, 0, '', 0, 0, 2012, 1338871953, 0),
