(333, 99, 0, 0, 0, 'SLC’s is a premier institute of engineering that has carved a niche for itself in the field of technical education in a very short span of time. Since its inception in 2005, under the aegis of Jawaharlal Nehru Technological University, the college has made its presence felt in the technical horizon of the state.\r\nUnique in its structure, methods and goals, the college is strongly rooted in a philosophy of training and research that emphasizes the intimate relationships between knowledge and its application and seeks to promote the creation of an ideal society.\r\nThe college is situated at Piglipur village, an idyllic spot near Ramoji Film city - Hyderabad.\r\n', 'M TECH, M B A, M C A, MECH ENGG, I T, C S E, E C E, E E E', ' Hayat Nagar', NULL, 105, 'Satyam Learning Campus Institute ', '', '+(91)-(40)-32212115', '+(91)-(40)-32212115', ' 500036			', 'Piglipur Village,   Ramoji Film City,  R R District,  Pochampally X Roads', '', 'http://www.slc.edu.in/', 0, 0, '', 0, 0, 2012, 1345866056, 0),
(334, 99, 0, 0, 0, 'Sri Indu College of Engineering & Technology was established in 2001 by New Loyola Model Education Society, Vanasthalipuram, Hyderabad. The Society is having proven rich experience in the field of education for more than 33 years, with an intention and commitment to impart School and Technical education of highest quality. \r\nThe college has been accredited by National Board of Accreditation, AICTE, New Delhi,  ISO 9001:2000 Certified and also permanently affiliated to JNTU, Hyderabad, within a very short span of time. The credit of this achievement goes to the great effort & team work of the management, the faculty and non-teaching staff.', 'Mech Engg, Bio tech, Aeronautical, I T, E E E, C S E, E T M, E C E, civil', ' Vanasthalipuram', NULL, 105, 'SRI Indu Group Of Institutions', '', '+(91)-(40)-24242592', '+(91)-(40)-24242592', ' 500661			', 'Opp To Vaidehi Nagar Bus Stand', '', 'http://www.sriindugroup.org/', 0, 0, '', 0, 0, 2012, 1345864305, 0),
