(338, 99, 0, 0, 0, 'The academic year of 1997-98 marked the beginning of DVR College of Engineering & Technology with the vision and mission to develop good, ethical engineers through innovative and qualitative teaching methodologies.\r\nOur Vision is to be the centre of excellence in technical education and our mission is\r\n• To have the right faculty delivering knowledge.\r\n• To have the state of the art infrastructure to implement the knowledge\r\n• To match theory and practice to the industry requirements ', 'MTech, M B A, Chemical Engg, Civil Engg, Mechanical Engg, CSE and IT, EEE, ECE, VLSI Design and Embedded Systems', ' Madhapur', NULL, 105, 'DVR College Of Engineering & Technology', '', '+(91)-(40)-23116278', '+(91)-(40)-23116278', ' 500033			', 'H No 2-56/33/20/6,  Ayyappa Society Road', '', '', 0, 0, '', 0, 0, 2012, 1345404196, 0),
(339, 99, 0, 0, 0, 'The CRV Institute of Technology & Science(CRVITS) has carved out a niche for itself and is recognized as a premier educational institution. It abounds in well equipped, latest and sophisticated laboratories, well stocked central and departmental libraries,highly qualified,experienced and dedicated faculty members. In tune with the noble ambitions and aspirations of Mr V. Chalapathi Rao to keep the institution ever growing and developing continuously so as to become as big as the ocean, all the departments are continuously encouraged to implement appropriate and necessary procedures to initiate, include and conduct more programmes in frontier areas.', 'MBA, M Tech, B Tech, IGNOU', ' Hakeempet', NULL, 105, 'Crv Institue Of Technolgies & Sciences', '', '+(91)-9490694680', '+(91)-9490694680', ' 500014			', 'Lalgadi Malakpet', '', '', 0, 0, '', 0, 0, 2012, 1345400230, 0),
(340, 99, 0, 0, 0, 'Bandari Srinivas Institute of Technology (BSIT) is established during 2003-2004 which is approved by A. I. C.T. E, New Delhi and affiliated to J.N.T.U, Hyderabad and recognized by the Govt of Andhra Pradesh. The Principal and the Advisory Council Members are the engineers and Academicians associated with the J.NT University right from the starting year (1972) of the University. They form the best team to guide the destiny of BSIT to stand up as one of the best Institutes.\r\n\r\nThe Institute is located in Chevella Mandal about 5km from Chevella Village on Chevella to Shankarpally Road. \r\n\r\nBSIT encourages meritorious students with Gold Medals and Cash Awards. Fee concession is given for the students', 'MTech, IT, Civil Engg, Mech Engg, ECE, EEE, CSE', ' Mehdipatnam', NULL, 105, 'Bandari Srinivas Institute Of Technology', '', '+(91)-(40)-66758834', '+(91)-(40)-66758834', ' 500028			', '101,  Srinivasa Plaza,  Above Food World,  Rethibowli Ring Road', '', '', 0, 0, '', 0, 0, 2012, 1345487019, 0),
(341, 99, 0, 0, 0, 'Chaitanya Bharathi Institute of Technology is one of the premier Engineering  Colleges in the self-financing category in Andhra Pradesh. It has been accredited twice in 1998 and again in 2004 by NBA(AICTE). It is also the first ISO 9001-2000 certified Engineering Institute of AP. The total constructed area is  4,45,467 sq. ft.  worth about Rs 25..00 crores spread on 30 acres. The grants recieved from AICTE are worth about Rs. 1.3 crores. The college offers 9 UG and 7 PG coureses. Brilliant and meritorious candidates with 196 EAMCET rank onwards are seeking admission in CBIT especially in ECE, EEE, CSE, IT, Mechanical Engineering etc. The percentage has also been consistent with 95% on an average. Out of them, 80% of the students are passing either in distinction or in first class. For the last two years, about 75 to 80% of our students are provided with jobs through college placement cell.\r\n\r\nCBIT stands as the only Engineering College in the state with number of students placed in reputed organizations through campus interviews.', 'MCA, Post Graduate Courses, Electronics and Communication engineering, Computer Science Engineering, Bio technology, MBA', 'Gandipet', NULL, 105, 'Chaitanya Bharati Institute Of Technology', '', '+(91)-(40)-35138927', '+(91)-(40)-35138927', ' 500075			', 'Gandipet', '', '', 0, 0, '', 0, 0, 2012, 1345474016, 0),
(342, 99, 0, 0, 0, 'Vidya Vikas Institute of Technology (VVIT) was established in 2001 by giving students a perfect platform to build the future in the field of science and engineering.\r\nVVIT is promoted by Vidya Vikas Education Society.\r\nThe college has a rich tradition of persuing academic excellence and overall personal growth. This is achieved by conducting regular examinations, providing excellent infrastucture and above all, with the presence of dedicated and highly qualified, faculty members, who strive in ensuring the all round development of the professionals emerging from this institute.', 'MBA, CIVIL, MECH, ECE, EEE, CSE, IT, MCA', ' Masab Tank', NULL, 105, 'Vidya Vikas Institute Of Technology', '', '+(91)-(40)-65132049', '+(91)-(40)-65132049', ' 500028			', 'Plot No 96,  H No 10-2-289/96/A,  Opp Veterinary Counsil,  Shanthi Nagar,  Road ', '', '', 0, 0, '', 0, 0, 2012, 1345473559, 0),
(343, 99, 0, 0, 0, 'Jagruti Institute of Engineering and Technology (JIET) is sponsored by Jagruti Education and Welfare Society. It''s principal goal is on student focus. This means to drive our practices and decisions by the needs of students. It''s Vision is to impart skills to students for rewarding career and\r\nto train upcoming engineers by providing career oriented educational programs of study in various disciplines consistent with current and future needs of the different professions is the mission.', 'MBA, MECH ENGG, CIVIL ENGG, IT, EEE, CSE, ECE, M TECH', ' Chikkadpally', NULL, 105, 'Jagruti Institute Of Engineering & Technology', '', '+(91)-(40)-27673288', '+(91)-(40)-27673288', ' 500020			', 'H No 1-8-522/7,  Siss Building,  Swaraj Hotel Lane', '', '', 0, 0, '', 0, 0, 2012, 1345464663, 0),
(344, 99, 0, 0, 0, 'Vidya Jyothi Institute of technology, popularly known as VJIT, is a light house of knowledge perched on the shores of higher technical education in AndhraPradesh.Founded in 1998 by a group of concerned academicians and enterprising educationists, VJIT quickly won the confidence of the parent community and the students to become one of the select destinations for future engineers. \r\nVJIT is closely located in the picturesque surroundings of the cool and breezy Osman sagar lake on one side and the serene and peaceful Chilkur Balaji temple.\r\n\r\nThe governing board of VJIT is a combination of experience and management skills, supported by a team of dedicated and highly successful faculty.\r\n\r\nThe college is accredited by NBA of AICTE.  The college has best academicians as its Heads..', 'MCA, MTech, ECE, IT, Mech engg, EEE, CSE, MBA', ' Himayat Nagar', NULL, 105, 'Vidya Jyothi Institute Of Technology', '', '+(91)-(40)-24553655', '+(91)-(40)-24553655', ' 500029			', 'Aziznagar Gate Himayathnagar', '', '', 0, 0, '', 0, 0, 2012, 1345475562, 0),
(345, 99, 0, 0, 0, '   IETE, Hyderabad Centre is the biggest in the country which was established in the year 1973. As on march. 2010, it has a strength of 1900 corporate members, 1724 student members, 41 student forums and 15 industrial members. Warangal and gulbara are the two sub centers. Tirupati centre which was sub centre for the last 3 years became centre during Sept. 2010. Inthese 37 years, the Centre has made many rapid strides in achieving academic as well as professional targets.\r\n\r\nDevelopment of infrastructural facilities for the continuing Education Program of IETE has been a continuous activity at this Centre. This Centre has adequately furnished Class Rooms, Electronic and Computer Laboratories fully equipped and Computer Centre comprising adequate number of Computers. This Centre has established Multimedia lab incurring an expenditure of Rs.30 lakhs with Internet facility which is being used by the Members and Students. ', 'Network Security, Antennas Microwaves, Medical Electronics, PCB Fabrication, EMT Tranmission Lines, Digital Signal Processing, Image Processing, MEMS Nanotechnology, Embedded Systems, Microprocessors Microcontrollers Embedded Systems, Computer HW  Networking, Neural Networks Fuzzy Logic, VLSI Design Repairiing, Computer Literacy, SUSIE SUMMER SCHOOL, DIPIETE DIP in Electronics, AMIETE B TECH, ALCCS M Tech, Mobile Communications', ' Osmania University', NULL, 105, 'Institute Of Electronics & Telecommunications', '', '+(91)-(40)-27098025', '+(91)-(40)-27098025', ' 500007			', 'Osmania University Campus,   Jamai Osmania Post Office', '', 'http://www.ietehyd.org/', 0, 0, '', 0, 0, 2012, 1345883163, 0),
(346, 99, 0, 0, 0, 'ICFAI is a group of institutions consisting of recognized universities, a deemed-to-be university and several institutions likely to be recognized as universities. The institutions aim to provide the best quality education in Business Management, Technology and Law.\r\nThe IFHE, Hyderabad, Andhra Pradesh, is a Deemed-to-be-university under Section 3 of UGC Act. 1956. It comprises of IBS Hyderabad (IBS), Faculty of Science and Technology (FST), Faculty of Law (FOL) and Faculty of Social Sciences (FOSS).', 'MBA, BBA LLB Hons, BBA, Ph D', ' Jeedimetla', NULL, 105, 'The ICFAI University', '', '+(91)-(40)-23080173', '+(91)-(40)-23080173', ' 500855			', 'Plot No 4-102,  Road No 7', '', 'http://www.icfaiuniversity.in/', 0, 0, '', 0, 0, 2012, 1345856243, 0),
(347, 99, 0, 0, 0, 'S. S. Institute of Technology was started in the year 2005 with the motive of encouraging the students “Towards Scientific Temperament”. Its aim is to impart the best professional educational courses like Engineering and Management to the students hailing from different backgrounds of the society. It is the place where learning begins with the thirst for knowledge and acquiring expertise.\r\nSSIT is located in sprawling campus spread over 10 acres amidst greenery in pollution free environment. The ambience is serene, spacious and setting conducive to creative learning.\r\n It is an ideal place to pursue higher education. The campus has two blocks catering to the needs of B. Tech, M. Tech, MBA & MCA students.\r\nIts Objectives are..............\r\n*To become one of the best institutes imparting quality technical education to the students.\r\n*To provide excellent infrastructure, teaching faculty, laboratories, workshops, library etc to the students.\r\n*To nurture a culture that supports humanity and ethics blend with technology.\r\n*To equip the students with necessary skill sets so as to face the challenges of the world.\r\n*To provide a dynamic environment that which caters to the needs of the students and improves their overall creativity and innovative skills.', 'M Tech, M B A, M C A, Civil Engg, Mech Engg, EEE, CSE, ECE, Humanities and Science', ' Dundigal', NULL, 105, 'S S Institute Of Technology', '', '+(91)-(40)-084182551', '+(91)-(40)-084182551', ' 500043			', ' Gandimaisamma X Road,  Qutbullapur Mandal', '', '', 0, 0, '', 0, 0, 2012, 1345570294, 0),
(348, 99, 0, 0, 0, 'Aurora’s Technological & Research Institute, formerly known as Karshak Engineering College, is one of the seven Engineering Colleges under the umbrella of the Aurora group of institutions. It was established under the aegis of the Karshak Vidya Parishad in the year 1999 in Kamareddy, Nizamabad district and now functions at its permanent location at Parvathapur, Uppal, Hyderabad. ATRI, accredited by the National Board of Accreditation (NBA), is approved by AICTE and affiliated to Jawaharlal Nehru Technological University, Hyderabad for conduction of its courses and recruitment policies as per the requirement of AICTE and the University.\r\nIt''s vision is to be a center of higher learning that can provide the best learning experience, the most productive learning community, and the most creative learning environment in engineering education and to be recognized as one of the best engineering colleges in India.And the primary mission of the Institute is to educate students, discover and disseminate knowledge through research. The Institute is committed to achieve excellence in these activities and the success and leadership of its programs are evaluated using the highest standards of quality, innovation and visibility\r\n ', 'M B A, M TECH, BIO TECH, MECH ENGG, CIVIL ENGG, E C E, E E E, I T, C S E, M C A', ' Hyderabad', NULL, 105, 'Karshak Engineering College ', '', '+(91)-(40)-27201006', '+(91)-(40)-27201006', ' 500001			', 'Parvathpur Village Uppal(Post)', '', 'http://www.atri.edu.in/', 0, 0, '', 0, 0, 2012, 1345857288, 0),
