(351, 99, 0, 0, 0, 'Progressive Engineering College, sponsored by S.R.K. Memorial educational society, Hyderabad, was established during the academic year 2002-03 with the approval of AICTE, New Delhi and recognition of the Government of Andhra Pradesh . The institution is affiliated to Jawaharlal Nehru Technological University, Hyderabad.\r\nThe College is located in a picturesque land of 26 acres at CHEEKATIMAMIDI Village of Bommala Ramaram Mandal, Nalgonda Distict and has built-up area of 2,00,000 sft.\r\nThe management members of the college have excellent educational bakground.', 'M Tech, M B A, EEE, ECE, CSE, CIVIL, MECH, M C A, H and S', ' Ameerpet', NULL, 105, 'Progressive Engineering College', '', '+(91)-(40)-66785586', '+(91)-(40)-66785586', ' 500016			', 'Flat No 701 Shubham Apartments,  Opp Big Bazaar Lane', '', '', 0, 0, '', 0, 0, 2012, 1345572147, 0),
(352, 99, 0, 0, 0, 'CM Engineering College (CMEC) has been established under the aegis of the Malla Reddy Group of Institutions, a majestic empire, founded by Mr. CH. Malla Reddy. He has been in the field of education for the last 19 years with the intention of spearheading quality education among children from the school level itself. CM Engineering College has been laid upon a very strong foundation and has ever since been excelling in .', 'I T, Aeronautical Engg, E C E, C S E, E E E, M B A, M C A, M Tech, Mech', 'Himmat Nagar', NULL, 105, 'C M Engineering College', '', '+(91)-(40)-64634236', '+(91)-(40)-64634236', ' 500003			', 'Himmat Nagar', '', '', 0, 0, '', 0, 0, 2012, 1345750775, 0),
(353, 99, 0, 0, 0, 'We offer training in the following:', 'CIVIL ENGG, M B A Finance, M C A, I T, MECH ENGG, C S E, E C E', ' Abids', NULL, 105, 'Noor College Of Engineering & Technology', '', '+(91)-(40)-66668174', '+(91)-(40)-66668174', ' 500001			', '5-8-600 To 604 2ND FLR,  Mubarak Bazar,  Opp Lane Hollywood Showroom', '', 'http://jntuhaac.com/collegeinformation.php?code=66', 0, 0, '', 0, 0, 2012, 1345860699, 0),
(354, 99, 0, 0, 0, 'The SCIENT Institute of Engineering & Technology was started in 2001, approved by AICTE, New Delhi & affiliated to Jawaharlal Nehru Technological University, Hyderabad. It is located in 32 acres of lush green sprawling campus. It is approximately 25 km from Hyderabad and well connected by a network of roads. The College is aiming for NBA accreditation to prove that “SCIENT” is marching towards excellence. It"s Vision & Mission is to provide QUALITY EDUCATION in Engineering & Technology through efficient teaching and giving exposure to good Engineering practice with a familiarity of National & International Codes of practice and by developing a strong bilateral relationship with industry and leading professional Institutions within the country and abroad.\r\n', 'I T, E E E, E C E, C S E, CIVIL ENGG', ' Kachiguda', NULL, 105, 'Scient Institute Of Engineering & Technology', '', '+(91)-(40)-24737387', '+(91)-(40)-24737387', ' 500027			', '3-2-848/11,  Opp Mahavir Hotel Kachiguda Station Road', '', 'http://education.oneindia.in/', 0, 0, '', 0, 0, 2012, 1345859331, 0),
