(356, 99, 0, 0, 0, 'NRES is an independent and privately endowed organisation. It aspires to promote world-class educational institution where teaching and relevant research are its primary purpose. The institute encompasses numerous academic departments, divisions, and degree-granting programmes, as well as interdisciplinary centers and laboratories. \r\nThe institute is located on 12 acres with sprawling green lawns, and scenic beauty in its hinterlands in Ghatkesar Mandal of Ranga Reddy District.\r\n\r\nWe intend to establish a system of Continuous Quality Improvement (CQI) processes that would evaluate the quality of education and training and improve the teaching-learning methods to ultimately lead the Institute to Excellence.\r\n', 'M Pharmacy, B Pharmacy, CIVIL, ME, EEE, ECE, CSE, MBA', ' New Bowenpally', NULL, 105, 'Narsimha Reddy Engineering College', '', '+(91)-(40)-32434387', '+(91)-(40)-32434387', ' 500011			', '1-30-112,  Jaya Enclave', '', '', 0, 0, '', 0, 0, 2012, 1345752193, 0),
(357, 99, 0, 0, 0, 'Swami Vivekananda PG College, Secunderabad was established in 1862 by Late Mr. Somasundaram Mudaliar, the first public school for primary education. Started as a primary school, Mahbub College has advanced forward towards their goal of imparting knowledge and now the 143 year old institution supports the cause of Post Graduate Education. Swami Vivekananda PG College is the only venue in Hyderabad where Swami Vivekananda has addressed a large gathering in 1893. Swami Vivekananda PG College is to commemorate the spiritual icon of our country; the MBA College is named after him.\r\nIts objectives are:\r\n*To inculcate moral values in our students apart from regular academics, in order to shape them into responsible citizens and committed professionals.\r\n*To provide qualitative true education as propounded by Swami Vivekananda\r\n*To provide education by which character is formed, strength of mind is increased and intellect is expanded.\r\n*To break the monotony of classroom education, encouraging students to take active participation.\r\n*To facilitate all-round development of our students through our unique 9-point programme.\r\n', 'MBA, MBA IT, MBA HR, MBA finance, MBA Marketing', ' Paradise', NULL, 105, 'Swami Vivekananda PG College', '', '+(91)-(40)-27713827', '+(91)-(40)-27713827', ' 500003			', 'Clock Tower,  Mahbub College Campus,  Opp Natraj Cinema Hall,  Patny Centre', '', '', 0, 0, '', 0, 0, 2012, 1345756128, 0),
(358, 99, 0, 0, 0, 'SWEC was established in the Academic year 2001-2002 with the permission of AICTE,New Delhi and Government of A.P.The College is affiliated to J.N.TU.Hyderabad. The Sridevi Educational Society, Hyderabad, registered under the Societies Registration Act, in furtherance of its objectives to fulfill the long felt educational needs of the state, has started this Institute from the Academic year 2001-02,with an annual intake of 180 students.\r\nThe present intake of students for the four year B-Tech degree programme is 420 and for the PG programme (MBA and MCA) is 120. The total strength of the institution is 540.', 'M C A, M B A, I T, C S E, E I E, E C E, E E E, M TECH', ' L B Nagar', NULL, 105, 'Sridevi Engineering College', '', '+(91)-9390228321', '+(91)-9390228321', ' 500036			', 'Plot No. 16-94-136/4,   Raghu Medicals,  B N Reddy Nagar', '', 'http://www.srideviengg.com/', 0, 0, '', 0, 0, 2012, 1345861450, 0),
(359, 99, 0, 0, 0, 'KMIT, established in the academic year 2007-08 , occupies a place of pride amongst the premier technical institutes in the state of Andhra Pradesh. KMIT is sponsored by Keshav Memorial Education Society (KMES) ,well known in Hyderabad ,for the past 70 years, for running various educational institutions of repute.\r\n\r\nKMIT is approved by All India Council for Technical Education (AICTE), New Delhi, and affiliated to Jawaharlal Nehru Technological University (JNTU), Hyderabad and recognized by Govt. of AP. \r\n\r\nKMIT is co-promoted and powered by GENESIS SOLUTIONS PVT LTD, a premier and pioneer institute in Hyderabad in imparting IT industry focused software training and education in emerging technologies and having tie-ups with leading MNCs.\r\n\r\nKMIT campus is located in Narayanaguda, a central place in the city of Hyderabad. The vision of the institution is to create 3600 thinking engineers to cater to industry needs.\r\n', 'E I E, E C E, I T, C S E, M TECH', ' Narayanguda', NULL, 105, 'Keshav Memorial Educational Society', '', '+(91)-(40)-27555985', '+(91)-(40)-27555985', ' 500029			', '3-5-1026', '', 'http://www.kmit.in/', 0, 0, '', 0, 0, 2012, 1345866818, 0),
(360, 99, 0, 0, 0, 'Netaji, the esteemed Institution for Engineering & Technology came into existence in the auspicious year 2004. It was an offspring of Lord Grace Educational Society, which had been running successfully under the able and wise guidance and supervision of noble academicians.The college was established with four streams namely ECE,EEE,CSE and ME .Netaji has spread its wings even into Pharmacy courses. The group has established a pharmacy college in 2007-08.It has been running successfully creating the young professionals.\r\n           The College was approved by AICTE, New Delhi, and affiliated to JNT University, Hyderabad.\r\nThe Vision of the college is to see its students,packed with scientific inquisitive character,engineering new ideas,improvising technologies and beaming in good ethics and values.\r\nThe college works with a mission to make its students understand themselves well, discover their objectives of life, learn importance of discipline and determination to reach the goal and apply their wisdom to take the challenges and achieve pride. \r\n\r\n', '', ' Kothapet', NULL, 105, 'Netaji Group Of Institutions', '', '+(91)-(40)-24057849', '+(91)-(40)-24057849', ' 500036			', 'H No 23-25,  Kontham Ram Reddy Complex,  5TH Floor,  Opp Fruit Market,  Beside V', '', 'http://www.nietians.com/', 0, 0, '', 0, 0, 2012, 1345861934, 0),
