(365, 99, 0, 0, 0, 'HPS strongly believes that, in each & every child lies a genius whose versatility is waiting to be unleashed. Every child is gifted with an innate aptitude towards a chosen area, which needs to be identified, addressed, nurtured, groomed and harnessed. The school rightly adapts the Play Way method of Education to enrich, enlighten & empower children with knowledge on all contemporary fronts. The ultimate aim of HPS is to mould today''s young generation into responsible & successful denizens of tomorrow with all round accomplishments to their credit. The institution aims to set a brand new trend in grooming tender minds to tackle the tough challenges posed by an increasingly tentative tomorrow. HPS, an academic institution with a global perspective is all set to positively impact the way primary education is imparted. The academic hub adopts unique, student friendly teaching methodologies to facilitate interactive learning that''s vital in broadening the children''s knowledge horizons on various fronts and enriching their intellect spectrum.\r\n\r\nMission\r\nTo innovate novel changes in the prevalent academic system by laying emphasis on tapping the innate talents & inherent aptitude of tiny tots and flame that natural spark into a bright flame that exudes brilliance and sets an example par excellence.\r\n\r\nVision\r\nTo introduce the world to a refreshingly new yet effective Educational system that is Interactive, Interesting Informative and Incredibly economical.', 'Drills and Physical Exercises, Creativity, General Knowledge, Numerical Ability, Arts and Crafts, Physiological and Social Development, Mental Ability', ' Himayat Nagar', NULL, 114, 'HPS Kids', '', '+(91)-(40)-66737373,', '+(91)-(40)-66737373,', ' 500029			', 'Flat :#303, Anm Trade Center,  Aaltos', '', 'http://www.hps.co.in/', 0, 0, '', 0, 0, 2012, 1346698453, 0),
(366, 99, 0, 0, 0, 'SHEMROCK has been known as an innovative Play school- one devoted to experimentation and positive change. Every part of SHEMROCK life is a valuable arena of learning & a sense of balance permeates every aspect of life here.	\r\nSHEMROCK is able to provide the best possible environment for healthy development of young children following the Montessori System of teaching. This system neither imposes upon the child nor does it abandon him in total free play. It provides a carefully planned and structured environment in which the child grows and learns in a natural way. Following child-centered approach, the programme of the preschool is planned in such a way that it not only clarifies concepts, but also meets the various needs of the child as :\r\n- Refinement of senses \r\n- Gross motor development \r\n- Fine motor development \r\n- Language development \r\n- Development of concepts \r\n- Cognitive skill development \r\n- Social development \r\n- Personality / Psychological development\r\n- Creative arts and music \r\n- Practical life (Care of self and environment)', '', ' Sanath Nagar', NULL, 114, 'All Green  Fields', '', '+(91)-(40)-23815436,', '+(91)-(40)-23815436,', ' 500018			', 'Czech Colony,  Opp Gokul Theatre,  Street No.1', '', 'http://www.shemrock.com/', 0, 0, '', 0, 0, 2012, 1346054910, 0),
(367, 99, 0, 0, 0, 'Our endeavour at FirstSteps is to build up the next generation with the right values and concepts through creative learning. With our love, care and personal attention, we nurture the little ones. Parents are encouraged to be a part of the child''s learning process.\r\n\r\nBrittle as a child''s mind is, ''Handle With Care'' and compassion is our motto. All staff members have been chosen for their warmth and dedication. Our facilitators are continuously upgraded in '' Early Childcare Education(ECE).\r\n\r\nInhouse training modules for our educators/staff ensure, we nurture innocence and curiosity of each child.\r\n\r\nOur mission is to nurture innocence and curiosity in partnership with parents, grand-parents and guardians.', 'Language II, Mother tongue of the child, Daily care of plants and animals, songs and stories specifically written, Selection of rhymes', ' Sainikpuri', NULL, 114, 'First Steps', '', '+(91)-(40)-27115688,', '+(91)-(40)-27115688,', ' 500594			', '171, Vayupuri,  Syndicate Bank Road', '', 'http://www.firststeps-playschool.in/', 0, 0, '', 0, 0, 2012, 1346057188, 0),
