(390, 99, 0, 0, 0, 'Kangaroo Kids Preschools revolve around action-based learning using innovative teaching methods. Our pre-schools are recognized by mainstream schools as institutions that produce confident, creative and eager learners. They incorporate path-breaking research on the way the brain processes information. The critical years of learning are from birth to age of five, which constitute the Kangaroo Kids preschool years. \r\nKKEL’s curriculum is based on active and experiential learning. An optimum teacher-student ratio ensures effective implementation of this activity-based curriculum.\r\n\r\nThe vision that guides is ''KKEL is an innovative, vibrant, creative and energetic organization where each one of us strives through our practice to wholeheartedly serve children and make every learning moment a joyful, effective and meaningful one.''', 'Jr KG, Nursery, Playschool, Sr KG', ' Banjara Hills', NULL, 114, 'Kangaroo Kids', '', '+(91)-(40)-23542399', '+(91)-(40)-23542399', ' 500034			', '8-2-282/A ,  Banjara Hills,   Banjara Hills Police Station,  Road N 3', '', 'http://www.kkel.com', 0, 0, '', 0, 0, 2012, 1345922410, 0),
(391, 99, 0, 0, 0, 'The long established school is licensed by Miami-Dade County and the State of Florida as an Educational Institution and is accredited through the Pan American Montessori Society (PAMS).  Montessori Children''s House meets the established code of ethics as a long time member of the  American Montessori Society (AMS) and the North American Montessori Teacher''s Association (NAMTA).\r\n\r\nThere are several reputable Montessori organizations that accredit Montessori teacher education programs in the United States, and many more in other countries. Most, but not all, of their accredited programs are also accredited by the MACTE commission. They include the American Montessori Society (AMS), the Association Montessori Internationale (AMI), Montessori Educational Programs International (MEPI), and the Pan American Montessori Society (PAMS).\r\n\r\nMontessori Children''s House continues to fulfill its dutiful commitment to its students by providing dedicated long term AMS and/or PAMS certified teachers in all of its classrooms. The School prides itself on upholding its ethics, principles and foundations as inspired by the ideology of the Montessori founder, Maria Montessori. It''s Owner and Director, Melanie Samuelson, is an AMS Certified Montessori Directress/teacher since 1986. She has devoted over twenty-five years to teaching small children and administrating a quality school.', 'Swimming Lessons, Gymnastics, pre k k class, Toddler class', ' Lakdi KA Pool', NULL, 114, 'Taraporewallas Montessori House Of ...', '', '+(91)-9246577537', '+(91)-9246577537', ' 500004			', '11/5/411/1,  Azeem Manzil,  Opposite Senoir Office Quarter,  Red Hills', '', 'http://www.montessorichildrenshouse.com/', 0, 0, '', 0, 0, 2012, 1345978337, 0),
(392, 99, 0, 0, 0, 'EuroKids work towards exploring the innate potential of each child believing each child to be unique. Our goal is to stimulate their curiosity, guide them to explore, help them to acquire skills and instill the joy of learning which would set the tone for the rest of their lives.\r\nOur programs incorporate an integrated curriculum that promotes learning primarily through music, art, drama, dance, projects, discover centers, computer activities, field trips, outdoor play and adventure.\r\n\r\nEuroKids India, with its innovative approach, has set up a many preschools, playschools and kindergarten programs across India to work towards the development of kids.', 'Nursery, EuroJunior, Playgroup, EuroSenior', ' Ameerpet', NULL, 114, 'Euro Kids', '', '+(91)-(40)-65591739', '+(91)-(40)-65591739', ' 500016			', '7-1-59/9/A,  Opp SVR Hospital,  Dharam Karan Road', '', 'http://www.eurokidsindia.com', 0, 0, '', 0, 0, 2012, 1345921046, 0),
