(398, 99, 0, 0, 0, 'School of Little Scholars'' private preschool and kindergarten programs promote each child''s social, emotional, cognitive, and academic development in positive ways designed to further curiosity and creativity. Each classroom environment creatively respects the developmental needs of each student.\r\nLittle Scholars children learn through positive, cognitive (hands-on) activities directed by talented, caring teachers. They sense that School of Little Scholars is a "home-away-from-home" school where they will receive a wonderful education in a nurturing, positive environment. All aspects of teaching take place in relaxed, nurturing atmospheres. Self-esteem takes precedence. Little Scholars students are encouraged to learn to make their own decisions and to solve problems. \r\nSchool of Little Scholars will not compromise its mission of nurturing the positive growth and development of children. The security and safety of Serendipity students are paramount. The students'' happiness and personal growth are the products of the caring and loving staff and the positive physical environment of the school. The success of School of Little Scholars will be measured by witnessing our students who not only find happiness and joy in our educational setting but who learn with incredible proficiency.\r\nOur ultimate objective envisions the long-term personal and educational growth of our students that will bolster their personal and professional success and happiness.\r\n', 'After School Program, Kindergarten, Pre Kindergarten, Pre School, Summer Camp', ' Sanath Nagar', NULL, 114, 'Little Scholar School', '', '+(91)-9246878154', '+(91)-9246878154', ' 500018			', 'D No 7-2-A5,   Radha Krishna Toyota Show Room Behind', '', 'http://www.solsduarte.com', 0, 0, '', 0, 0, 2012, 1346091795, 0),
(399, 99, 0, 0, 0, 'Kidzee content is designed with an emphasis on every child''s unique learning styles. Special care is given to children''s social and cultural sensitivities.\r\n\r\n Within almost a decade of its existence, Kidzee has nurtured more than 2,00,000 children throughout India. Being a pioneer and a leader in ECCE (Early Childhood Care & Education), Kidzee has set unparalleled standards in the CDE (Child Development & Education) space. \r\nWith over 900+ centers in more than 330+ cities, Kidzee is the largest preschool chain in Asia. \r\nWith years of dedicated research done by its CDE experts, Kidzee has developed the best-in-class child centric learning methodology called iLLUME. Through iLLUME, Kidzee ensures that every child learns and develops in the best possible way.	 \r\n 	 	 \r\n', 'Nursery, Play Group, Parent Toddler, KinderGarten', ' Attapur', NULL, 114, 'Kidzee', '', '+(91)-(40)-64535656', '+(91)-(40)-64535656', ' 500264			', 'Plot 2 Survey 5,  Chaitanaya Vilas Colony  Hyderguda,  jana priya utopia', '', 'http://www.kidzee.com', 0, 0, '', 0, 0, 2012, 1345974909, 0),
