(413, 99, 0, 0, 0, 'Oi Play School is an educational initiative of People Combine, a group that has pioneered & redefined the way education has been perceived in India. We are the creators of Oakridge International School –\r\n the first IB World School of Andhra Pradesh.  \r\n\r\n‘Education is a gift for life’. We believe in creating the Global Leaders of tomorrow through our curriculum which looks at preparing the child for a life beyond School rather than examining how well the students have learnt the curriculum. Our teachers are the facilitators preparing the child for a lifelong learning process. It is a world that encourages your child to explore, be inquisitive, question everything and find answers through a process of discovery. We make the child learn through a strong partnership with the Parents where he himself cherishes the child growing each day.\r\n\r\nVision:\r\nCommitted to create global leaders in partnership with parents through our early childhood program.\r\n', '', ' Sainikpuri', NULL, 114, 'Oi Play School', '', '+(91)-8374634283', '+(91)-8374634283', ' 500594			', '38a,  Eshwar Palli Colony,   Raj Kamal Mini Market', '', 'http://oiplayschool.com/', 0, 0, '', 0, 0, 2012, 1346006691, 0),
(414, 99, 0, 0, 0, 'Welcome to VIBGYOR Kids the colourful, fun-filled world of preschool education that meets International Standards. Our aim is to develop the inherent potential in every child and ensure an easy transition into Kindergarten and beyond. We do this by offering Kids the best teachers, curriculum and teaching methodologies in a safe, supportive and positive learning environment.\r\n Our school education targets all six learning areas:\r\n\r\nPersonal, Social and Emotional Development.\r\nCommunication, Language and Literacy.\r\nMathematical and Logical Development.\r\nKnowledge and Understanding of the World.\r\nPhysical Development.\r\nCreative Development.\r\nKeeping our Company’s vision and purpose as the guiding principle for achieving leadership in sectors of national importance, we have identified franchising as one of the quickest and the most appropriate ways to grow aggressively and benefit all stake holders including parents, children and investors.\r\nThe curriculum implemented at VIBGYOR Kids contributes to achieving an inclusive development with emphasis on the psychological, intellectual, and physical development of the little child. It is a happy blend of concepts, art, craft, play and activities designed to achieve physical and mental dexterity at the child’s own pace. The curriculum, its implementation and the fostering of a healthy teacher-child-parent relationship, aim at providing a safe, secure and stimulating environment to the little Vibgyorites\r\n\r\nVIBGYOR Kids understands the importance of these critical formative years and it is a pioneer in early childhood education in India. Based on the key principles of individual attention, progressive thinking and training life skills, VIBGYOR Kids has embarked on a journey of helping to create a generation which has the presence of mind and the skills essential to manage life with dignity and intelligence. ', '', ' Somajiguda', NULL, 114, 'Vibgyor Play School', '', '+(91)-(40)-40025437', '+(91)-(40)-40025437', ' 500082			', '1ST Floor, Geetanjali College.,  Yashoda Hospital Lane', '', 'http://www.vibgyorkids.net', 0, 0, '', 0, 0, 2012, 1346003991, 0),
(417, 210, 0, 0, 0, ' Integra Soft Labs would be very glad to partner with  and achieve business goals in a collaborative manner.\r\n\r\nIntegrasoftlabs takes pride in creating success stories for clientele and sustain a long term partnership leveraging mutual strengths. the lab has a dedicated and highly committed team that enables us to strengthen our relationships with all esteemed customers globally.', 'SAP ABAP', 'Ameerpet', NULL, 68, 'Integra Soft Lab', '', '', '040-67271604', '500016', 'Balaji Towers,Flat No :602,Block -A,Prime Hospital Road,', 'Prime Hospital Road', 'http://www.integrasoftlab.com', 0, 0, '', 2, 0, 2012, 1348246292, 0),
(418, 211, 0, 0, 0, 'Lawrence IT – is the subsidiary of LAWREL INFOTECH PVT LTD (www.lawrel.com). At Lawrence IT, it is poised to give training solutions that would enhance the skill sets & knowledge spectrum of the participants.\r\n\r\nStarted by team of young and dynamic professionals having vast real time experience in the IT Industry, Lawrence IT provides the best possible training in all Functional, Technical, Techno-Functional modules along with New-Dimensional Products, & Industry Specific Modules and E-Business Solutions like Business Objects (BOBJ).In addition  the expertise to impart customized training in all the new releases as well.\r\n\r\nLawrence IT has been providing SAP Online Training in advanced technologies like SAP since 2010. Also practical hands-on workshops and Case Study based training provide students with the skills they require to meet today’s greatest business challenges.', '', 'Ameerpet', NULL, 68, 'Lawrence IT', '', '', '040-67116055', '500016', 'Flat No 406,4TH Floor,KVR Enclave', 'Above ICICI Bank', 'http://www.lawrenceit.in', 0, 0, '', 2, 0, 1348255140, 1348255140, 0),
