(444, 235, 0, 0, 2, 'First time in Hyderabad by Real Time Expert and we have completed 40 successful batches on SAP CRM Technical  Training.\r\nSAP CRM Technical  Training Modules are designed in such way that it meets the needs of the current IT industry with full level of Practical Session with Live Examples / Systems.\r\nAbout Trainers\r\nOur Trainers are industry expert in SAP CRM Technical , They have around 10 Yrs of experience and working for Companies like IBM, Accenture, MicroSoft, JhonDeere.\r\nWe have also provided Corporate Training Sessions through offline and online for companies likeGlobalData, Zensar, Sysnetts, EOK Technologies, iShift, ERPandERP, Compquest America.\r\nWe are also provide SAP CRM Technical  material.\r\nWe are providing follwoing training course content\r\nSAP CRM Technical – SAP CRM Ehp1\r\nSAP CRM Conceptual Overview\r\nFunctionality overview of SAP CRM\r\nIntroduction to Business Server Pages\r\nArchitecture of Business Server Pages\r\nComponents of a Business Server page\r\ni.      Controllers\r\nii.      Business Server Page\r\nPage with flow logic\r\nView\r\nPage Fragment\r\niii.      Navigation structure\r\niv.      Application Class\r\nv.      MIME Objects\r\nvi.      Page Attributes\r\nvii.      Layout\r\nviii.      Event Handlers\r\ni.      Basic Model\r\nii.      MVC approach\r\nBSP Programming models\r\nExample Applications\r\nDebugging BSP Applications\r\nCRM Web UI Basics – CRM 7.0\r\nUI Concepts\r\nWeb UI Architecture\r\nBusiness Roles customizing\r\nNavigation Bar customizing\r\nWebUI Component Work bench\r\ni.      WebUI Component Concept\r\nii.      Elements of WebUI Component\r\niii.      Component Controller\r\niv.      Custom Controller\r\nv.      Views\r\nvi.      View Controller\r\nvii.      Context\r\nviii.      Context nodes\r\nix.      Runtime Repository\r\nUI Configuration\r\nTransaction launcher\r\nCRM Web UI Technical – CRM 7.0\r\nGENIL Model Browser\r\nGENIL BOL Browser\r\nComponent Context :\r\ni.      View Context Class\r\nii.      Context Nodes\r\nAttributes\r\nGetter and Setter Methods\r\ni.      Objects in BOL Programming\r\nii.      classes and Interfaces in BOL Programming\r\niii.      Accessing Component Sets and Components\r\niv.      Query execution – Query services\r\nv.      Accessing the BOL entities/Fields\r\nvi.      Using BOL Collections\r\ni.      Creating Transaction entities\r\nii.       Accessing Transaction entities\r\niii.       Modifying Transaction entities\r\niv.      Defaulting the field values\r\nBOL Programming Basics:\r\nBOL Transaction Programming\r\nError/Message Handling\r\nNavigations.\r\nCreating a Custom Component\r\nCreating a view\r\nMaking a view Configurable\r\nCreating a View set\r\nCreating a context node\r\nEvent Handlers\r\nInbound and Outbound Plugs\r\nNavigation maintenance\r\nAET (Application  Extensibility tool)\r\nAdding Custom fields using AET\r\nIntegrating custom fields into view configuration\r\nSearch/Result/Header view custom field  creation using AET\r\nIdentifying AET enabled objects\r\nDropdown values to custom fields\r\nReal Time Scenario Object development examples\r\nTransaction Launcher developments\r\nAdding buttons to views\r\nExample scenario of accessing component controller, custom controller, parent entity, child entity, collections\r\nAccessing BOL entities from non webui environment/context (Badi/Report/Function module)\r\nMessage handling example\r\nWeb services creation example\r\nSimple navigation between views\r\nCross component navigation (popup window example)\r\nreal time badi Implementation in Web UI perspective\r\nF4 help\r\nCRM 7.0 EHP1 New UI Features.\r\nSearch Enhancements\r\nUI Configuration\r\nCheck tool\r\nExtensibility Features.\r\nProgram Highlights\r\n10 years of Experience in CRM Technical (4.0, 5.0, CRM 2007 ,7.0  and EHP1)\r\nReal time Example Scenario’s (Content number 9)\r\nCourse Content can be customized as per the requirement.\r\nEmphasis on Component workbench enhancements\r\nInterview Tips and Techniques', '', 'Hyderabad', NULL, 124, 'SAP CRM Technical Online Training', '', '', '9440602555 ', '', 'Kukatpally', '', 'http://kalt.in', 0, 0, '', 0, 0, 1351662596, 1351662596, 0),
