(509, 281, 65, 91, 0, 'Yii is a fast, secure and professional PHP web framework. Yii is practically easy to use.\r\nMVC is used so much because it simplified application development and maintenance by separating the application into 3 logical components; model (business logic), view (look and feel) and controller (the "glue").\r\n\r\nThe features of Yiiframework are:\r\n1.	MVC architecture\r\nModel\r\nView\r\nController\r\n2.	Installing Yii\r\nCreating new application\r\n    directory structure\r\napplication configuration\r\nAutomatic code generation using gii module\r\n        configuring gii\r\n        configuring database\r\nusing gii to create AR classes\r\ncreate CRUD operations using gii\r\n3.	Working with form models\r\n  form model Vs Active Record\r\ncreating form elements using CHtml methods\r\ndeclaring input validation rules\r\nsafe attributes\r\ndisplay input errors\r\ncollecting tabular input\r\nForm builder\r\n4.	Working with databases\r\nData Access Objects(DAO)\r\n Query Builder\r\nActive Record\r\nRelational Active Record\r\n\r\n5.	Form Input and Validation\r\n6.	Ajax-enabled widgets\r\ncreating widgets\r\ncreate portlets\r\n7.	Authentication and authorization\r\n   define Identity class\r\n   login and logout\r\n\r\nIntroduction to Yii authentication model\r\nuser authentication using database \r\nprogramming user login\r\n8.	User Access control\r\nAccess control filter\r\nRBAC(Role based access control)\r\n    configuring the authorization manager\r\n    creating RBAC database tables\r\n    creating RBAC hierarchy\r\n    assigning roles to users\r\n   checking authorization level\r\n9.	Skinning and Theming\r\ndesigning layouts for views\r\nlayout nesting\r\ncreating themes\r\nconfiguring application to use a theme\r\n\r\n10.	Modules\r\ncrating and using a module\r\nmodule''s layout\r\nPath alias and namespaces\r\n\r\n11.	Url management\r\n    user-friendly urls\r\n    parameterizing routes\r\n    using custom url classes\r\n\r\n12.	Web services\r\n13.	Layered caching scheme\r\n14.	Error handling and logging\r\nadding a message log\r\nmessage routing\r\ndisplaying errors\r\ncaching\r\n   cache configuration\r\n   using file-based cache\r\n   query caching, fragment caching and page caching\r\n   \r\n15.	Security\r\n16.	Automatic code generation\r\n17.	Unit and functionality testing\r\n   installing PHPUnit\r\n18.	Extension library\r\ncreating extensions\r\nusing extensions\r\nusing third-party libraries\r\n19.	Friendly with third-party code\r\n20.	Internationalization\r\n21.	\r\n', 'hardware', 'Injapur', NULL, 93, 'Yii framework training by experienced PHP developer', '', '', '9032130433', '500035', 'Moosarambagh', 'Devaki School', '', 0, 0, '', 1, 5, 2013, 1375034431, 0),
